      @include euiSlightShadowHover;
    }
  }

  &:first-child {
    margin-left: 0;

    .euiButtonGroup__button {
      border-top-left-radius: $euiBorderRadius;
      border-bottom-left-radius: $euiBorderRadius;
    }
  }

  &:last-child .euiButtonGroup__button {
    border-top-right-radius: $euiBorderRadius;
    border-bottom-right-radius: $euiBorderRadius;
  }

  @include euiBreakpoint('xs', 's') {
    flex: 1;
    min-width: 0;

    .euiButtonGroup__button {
      min-width: 0;
    }
  }
}

.euiBreadcrumbs {
  @include euiFontSizeS;
}

.euiBreadcrumb {
  display: inline-block;

  &:not(.euiBreadcrumb--last) {
    margin-right: $euiBreadcrumbSpacing;
  }
}

.euiBreadcrumb--last {
  font-weight: $euiFontWeightMedium;
}

.euiBreadcrumb--collapsed {
  color: $euiColorLightShade;
}

.euiBreadcrumbSeparator {
  flex-shrink: 0;
  pointer-events: none;
  display: inline-block;
  margin-right: $euiBreadcrumbSpacing;
  width: 1px;
  height: $euiSize;
  transform: translateY(.2em) rotate(15deg);
  background: $euiColorLightShade;
}

/**
 * 1. Can't target separator vs breadcrumb with -of-type because it takes
 *    the dom element into consideration too and there could be divs, or spans, or a's
 *    as breadcrumbs.
 */

.euiBreadcrumbs--responsive {
  // Laptop
  @include euiBreakpoint('l') {
    .euiBreadcrumbSeparator,
    .euiBreadcrumb {
      display: none;

      // Only show last 4 breadcrumbs
      &:nth-last-child(-n+7) { /* 1 */
        display: inline-block;
      }
    }
  }

  // Tablets
  @include euiBreakpoint('m') {
    .euiBreadcrumbSeparator,
    .euiBreadcrumb {
      display: none;

      // Only show last 2 breadcrumbs
      &:nth-last-child(-n+3) { /* 1 */
        display: inline-block;
      }
    }
  }

  // Mobile
  @include euiBreakpoint('xs', 's') {
    .euiBreadcrumbSeparator,
    .euiBreadcrumb {
      display: none;

      // Only show last 1 breadcrumb
      &:nth-last-child(-n+1) { /* 1 */
        display: inline-block;
      }
    }
  }
}

.euiBreadcrumbs--truncate {
  white-space: nowrap;
  display: flex;
  align-items: center;
  overflow: hidden;

  .euiBreadcrumb:not(.euiBreadcrumb--collapsed) {
    max-width: $euiBreadcrumbTruncateWidth;
    min-width: $euiBreadcrumbMinWidth;
    overflow: hidden;
    text-overflow: ellipsis;
    text-align: center;

    &.euiBreadcrumb--last {
      max-width: none;
    }
  }

  .euiBreadcrumbSeparator {
    // Align with flex versus inline-block misaligns the separator slightly
    transform: translateY(0) rotate(15deg);
  }
}

.euiBreadcrumb--truncate {
  white-space: nowrap;
  max-width: $euiBreadcrumbTruncateWidth;
  overflow: hidden;
  text-overflow: ellipsis;
  text-align: center;
  vertical-align: top; // overflow hidden causes misalignment of links and slashes, this fixes that
}

$euiBreadcrumbSpacing: $euiSizeS;
$euiBreadcrumbTruncateWidth: $euiSize * 10;
$euiBreadcrumbMinWidth: $euiSizeS * 7; // Just wide enough to support "Users" without truncating

.euiCallOut {
  padding: $euiSize;
  border-left: $euiSizeXS / 2 solid transparent;

  &.euiCallOut--small {
    padding: $euiSizeS;
  }

  .euiCallOutHeader__icon {
    flex: 0 0 auto;
    // Vertically center icon with first line of title
    transform: translateY(2px);
  }
}

// Create callout modifiders based upon the map.
@each $name, $color in $euiCallOutTypes {
  .euiCallOut--#{$name} {
    border-color: $color;
    background-color: euiCallOutColor($name, 'background');

    .euiCallOutHeader__icon {
      fill: euiCallOutColor($name, 'foreground');
    }

    .euiCallOutHeader__title {
      color: euiCallOutColor($name, 'foreground');
    }
  }
}

/**
 * 1. Align icon with first line of title text if it wraps.
 * 2. If content exists under the header, space it appropriately.
 * 3. Apply margin to all but last item in the flex.
 */
.euiCallOutHeader {
  @include euiCallOutTitle;
  display: flex;
  align-items: baseline; /* 1 */

  + * {
    margin-top: $euiSizeS; /* 1 */
  }

  > * + * {
    margin-left: $euiSizeS; /* 3 */
  }

  // smaller font size for headers in small callout
  .euiCallOut--small & {
    @include euiCallOutTitle('s');
  }
}

// Modifier naming and colors.
$euiCallOutTypes: (
  primary: $euiColorPrimary,
  success: $euiColorSecondary,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
);

//** DEPRECATED **//
//** DEPRECATED **//
//** DEPRECATED **//
//** DEPRECATED **//

$callOutTypes: $euiCallOutTypes;

@function euiCallOutColor($type: 'primary', $returnBackgroundOrForeground: 'background') {
  @if (map-has-key($euiCallOutTypes, $type)) {
    $color: map-get($euiCallOutTypes, $type);
    $backgroundColor: tintOrShade($color, 90%, 70%);
    $foregroundColor: shadeOrTint(makeHighContrastColor($color, $backgroundColor), 0, 20%);

    @if ($returnBackgroundOrForeground == 'background') {
      @return $backgroundColor;
    } @else if ($returnBackgroundOrForeground == 'foreground') {
      @return $foregroundColor;
    } @else {
      @warn 'Incorrect value provided as $returnBackgroundOrForeground';
    }
  } @else {
    @warn 'Incorrect type of call out provided. See the $euiCallOutTypes map for allowed values.';
  }
}

@mixin euiCallOutTitle($size: null) {
  @if ($size == 's') {
    @include euiTitle('xxs');
    font-weight: $euiFontWeightRegular;
  } @else {
    @include euiTitle('xs');
    font-weight: $euiFontWeightRegular;
  }
}

/**
 *  Mixin for use in:
 *  - EuiCard
 *  - EuiPageContent
*/
@mixin euiPanel($selector) {
  @if variable-exists(selector) == false {
    @error 'A $selector must be provided to @mixin euiPanel().';
  } @else {
    .#{$selector} {

      @include euiBottomShadowSmall;
      background-color: $euiColorEmptyShade;
      border: $euiBorderThin;
      border-radius: $euiBorderRadius;
      flex-grow: 1;

      &.#{$selector}--flexGrowZero {
        flex-grow: 0;
      }

      &.#{$selector}--isClickable {
        // in case of button wrapper which inherently is inline-block and no width
        display: block;
        width: 100%;
        text-align: left;

        // transition the shadow
        transition: all $euiAnimSpeedFast $euiAnimSlightResistance;

        &:hover,
        &:focus {
          @include euiSlightShadowHover;
          transform: translateY(-2px);
          cursor: pointer;
        }
      }

      &.#{$selector}--shadow {
        @include euiBottomShadowMedium;

        @if (lightness($euiTextColor) < 50) {
          border-bottom-color: transparentize($euiShadowColor, .5);
        } @else {
          // Applied again here in case dark theme overrides light
          border-bottom-color: $euiBorderColor;
        }

        &.#{$selector}--isClickable:hover,
        &.#{$selector}--isClickable:focus {
          @include euiBottomShadow($color: $euiShadowColor, $opacity: .2);
        }
      }
    }
  }
}

@import '../panel/mixins';
@import '../badge/beta_badge/mixins';

// Start with a base of EuiPanel styles
@include euiPanel($selector: 'euiCard');

/**
 * 1. Footer is always at the bottom.
 * 2. Fix for IE where the image correctly resizes in width but doesn't collapse it's height
      (https://github.com/philipwalton/flexbugs/issues/75#issuecomment-134702421)
 * 3. Horizontal layouts should always top left align no matter the textAlign prop
 */

// EuiCard specific
.euiCard {
  display: flex;
  flex-direction: column;
  padding: $euiCardSpacing;
  min-height: 1px; /* 2 */

  // This creates a bunch of sub selectors for the beta badge
  @include hasBetaBadge($selector: 'euiCard', $spacing: $euiCardSpacing); // sass-lint:disable-line mixins-before-declarations

  .euiCard__top,
  .euiCard__content,
  .euiCard__footer {
    display: block;
    width: 100%;
  }

  &.euiCard--leftAligned,
  &.euiCard--isClickable.euiCard--leftAligned {
    text-align: left;
    align-items: flex-start;
  }

  &.euiCard--centerAligned,
  &.euiCard--isClickable.euiCard--centerAligned {
    text-align: center;
    align-items: center;
  }

  &.euiCard--rightAligned,
  &.euiCard--isClickable.euiCard--rightAligned {
    text-align: right;
    align-items: flex-end;
  }

  &.euiCard--isClickable {
    display: flex;

    &:focus,
    &:hover {
      .euiCard__title {
        text-decoration: underline;
      }
    }
  }

  &.euiCard--hasBottomGraphic,
  &.euiCard--isSelectable {
    position: relative;
    padding-bottom: $euiCardSpacing + $euiCardGraphicHeight;
  }

  &.euiCard-isSelected {
    @include euiBottomShadowMedium;
    transition: box-shadow $euiAnimSpeedFast $euiAnimSlightResistance, border-color $euiAnimSpeedFast $euiAnimSlightResistance;
  }
}

@each $name, $color in $euiCardSelectButtonBorders {
  .euiCard--isSelectable--#{$name}.euiCard-isSelected {
    border-color: $color;
  }
}

.euiCard__top {
  flex-grow: 0; /* 1 */
  position: relative;
  min-height: 1px; /* 2 */

  .euiCard__icon {
    margin-top: $euiCardSpacing / 2;
  }

  .euiCard__image {
    position: relative;
    width: calc(100% + (#{$euiCardSpacing} * 2));
    left: $euiCardSpacing * -1;
    top: $euiCardSpacing * -1;
    margin-bottom: $euiCardSpacing * -1; // ensure the parent is only as tall as the image

    // match border radius, minus 1px because it's inside a border
    border-top-left-radius: $euiBorderRadius - 1px;
    border-top-right-radius: $euiBorderRadius - 1px;

    // IF both exist, position the icon centered on top of image
    + .euiCard__icon {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -75%); // Fallback for IE as it doesn't accept calcs in translates
      transform: translate(-50%, calc(-50% + #{$euiCardSpacing * -1})); // sass-lint:disable-line no-duplicate-properties
    }
  }
}

// If an icon or image exists, add some space
.euiCard__top + .euiCard__content {
  margin-top: $euiCardSpacing;
}

.euiCard__content {
  flex-grow: 1; /* 1 */

  .euiCard__title {
    @include euiTitle($euiCardTitleSize);

    display: block;
    font-weight: $euiFontWeightMedium;
  }

  .euiCard__description {
    color: $euiTextColor; // Ensures regular text color if wrapped in an anchor tag
    margin-top: $euiCardSpacing / 2;
  }
}

.euiCard__footer:not(:empty) {
  flex-grow: 0; /* 1 */
  margin-top: $euiCardSpacing;
}

.euiCard.euiCard--horizontal {
  .euiCard__content {
    padding-top: $euiSizeS; // Aligns title and text a bit better and adds spacing in case of beta badge
    text-align: left; /* 3 */
  }
}

// Only change the flex direction if the card has an icon
// otherwise the button tag won't properly align contents to top
.euiCard.euiCard--horizontal.euiCard--hasIcon {
  flex-direction: row;
  // sass-lint:disable-block no-important
  align-items: flex-start !important; /* 3 */

  .euiCard__top,
  .euiCard__content {
    width: auto; // Makes sure the top shrinks and the content grows
    margin-top: 0;
  }

  .euiCard__top .euiCard__icon {
    margin-top: 0;
    margin-right: $euiSize;
  }
}

@import '../panel/variables';

$euiCardSpacing: map-get($euiPanelPaddingModifiers, 'paddingMedium');
$euiCardTitleSize: 18px; // Hardcoded pixel value for theme parity.
$euiCardGraphicHeight: 40px; // Actual height of the svg used in EuiCardGraphic

$euiCardSelectButtonBorders: (
  text: $euiColorSuccess, // Default for selected
  primary: $euiColorPrimary,
  success: $euiColorSuccess,
  danger: $euiColorDanger,
  ghost: $euiColorDarkShade,
);

$euiCardSelectButtonBackgrounds: (
  text: $euiColorLightestShade, // Default for unselected
  primary: tintOrShade($euiColorPrimary, 90%, 70%),
  success: tintOrShade($euiColorSuccess, 90%, 70%),
  danger: tintOrShade($euiColorDanger, 90%, 70%),
  ghost: $euiColorDarkShade,
