.react-datepicker__month {
  margin: 0 $euiSize $euiSize $euiSize;
  text-align: center;
  border-radius: $euiBorderRadius;
}

.react-datepicker__time-container {
  border-left: $euiBorderColor;
  width: auto;
  display: flex;
  padding: $euiSize 0;
  border-radius: 0 $euiBorderRadius $euiBorderRadius 0;
  flex-grow: 1;

  // &--with-today-button {
  // }

  .react-datepicker__time {
    position: relative;
    flex-grow: 1;
    display: flex;
    padding-left: $euiSizeXS;
    flex-direction: column;

    .react-datepicker__time-box {
      width: auto;
      display: flex;
      flex-direction: column;
      flex-grow: 1;

      ul.react-datepicker__time-list {
        @include euiScrollBar;
        height: 204px !important;
        display: flex;
        flex-direction: column;
        flex-grow: 1;
        overflow-y: auto;
        align-items: center;

        li.react-datepicker__time-list-item {
          padding: $euiSizeXS $euiSizeS;
          margin-bottom: $euiSizeXS;
          text-align: right;
          color: $euiColorDarkShade;
          white-space: nowrap;
          // IE needs this to fix collapsing flex
          line-height: $euiSizeM;

          &:hover,
          &:focus {
            cursor: pointer;
            text-decoration: underline;
          }
          &--selected {
            background-color: $euiColorPrimary;
            color: white;
            border-radius: $euiBorderRadius / 2;
            &:hover {
              background-color: $euiColorPrimary;
            }
          }
          &--disabled {
            color: $euiColorLightShade;

            &:hover {
              cursor: not-allowed;
              text-decoration: none;
              background-color: transparent;
            }
          }
        }
      }
    }
  }
}

.react-datepicker__week-number {
  color: $euiColorLightestShade;
  display: inline-block;
  width: $euiSizeXL;
  line-height: $euiSizeXL - $euiSizeXS;
  text-align: center;
  margin: 0 $euiSizeXS;
  &.react-datepicker__week-number--clickable {
    cursor: pointer;
    &:hover {
      border-radius: $euiBorderRadius;
      background-color: $euiColorEmptyShade;
    }
  }
}

.react-datepicker__day-names,
.react-datepicker__week {
  white-space: nowrap;
}

.react-datepicker__day-name,
.react-datepicker__day,
.react-datepicker__time-name {
  color: $euiColorFullShade;
  display: inline-block;
  width: $euiSizeXL;
  line-height: $euiSizeXL - $euiSizeXS;
  text-align: center;
  margin: 0 $euiSizeXS / 2;
}

.react-datepicker__day-name {
  color: $euiColorDarkShade;
  text-transform: uppercase;
}

.react-datepicker__day {
  cursor: pointer;
  border: solid 2px transparent;
  transition: transform $euiAnimSpeedExtraFast ease-in-out;

  &:hover:not(&--disabled) {
    text-decoration: underline;
    font-weight: $euiFontWeightBold;
    transform: scale(1.2);
  }

  &--today {
    font-weight: bold;
    color: $euiColorPrimary;
  }
  &--outside-month {
    color: $euiColorDarkShade;
  }

  &--highlighted {
    border-radius: $euiBorderRadius;
    background-color: $euiColorSecondary;
    color: $euiColorGhost;

    &:hover {
      background-color: darken($euiColorSecondary, 5%);
    }
  }

  &--in-range {
    background-color: transparentize($euiColorPrimary, .9);
    color: $euiColorFullShade;
    border-radius: 0;
    border-top: solid 6px $euiColorEmptyShade;
    border-bottom: solid 6px $euiColorEmptyShade;
    border-right: none;
    border-left: none;
    line-height: $euiSizeL - $euiSizeXS;
  }

  &--selected,
  &--in-selecting-range {
    height: $euiSizeXL;
    margin: 0 $euiSizeXS / 2;
    border-radius: $euiBorderRadius;
    background-color: $euiColorPrimary;
    line-height: $euiSizeL + $euiSizeXS;
    border: solid $euiSizeXS / 2 $euiColorPrimary;
    color: $euiColorGhost;

    &:hover {
      background-color: darken($euiColorPrimary, 5%);
    }
  }

  &--keyboard-selected {
    border-radius: $euiBorderRadius;
    border: solid $euiSizeXS / 2 $euiColorPrimary;
    font-weight: $euiFontWeightBold;

    &:hover {
      background-color: darken($euiColorPrimary, 5%);
      color: $euiColorGhost;
    }
  }

  &--in-selecting-range:not(&--in-range) {
    background-color: rgba($euiColorPrimary, 0.5);
  }

  &--in-range:not(&--in-selecting-range) {
    .react-datepicker__month--selecting-range & {
      background-color: $euiColorEmptyShade;
      color: $euiColorFullShade;
    }
  }

  &--disabled {
    cursor: not-allowed;
    color: $euiColorLightShade;

    &:hover {
      background-color: transparent;
    }
  }
}

.react-datepicker__input-container {
