@import '../form/variables';
@import '../form/mixins';

/**
 * 1. Account for inner box-shadow style border
 */

.euiDatePickerRange {
  @include euiFormControlSize(auto, $includeAlternates: true);
  // Match just the regular drop shadow of inputs
  @include euiFormControlDefaultShadow();
  display: flex;
  align-items: center;
  padding: 1px; /* 1 */

  // Allow any child to fill entire range container
  > * {
    flex-grow: 1;
  }

  .euiFieldText.euiDatePicker {
    box-shadow: none !important; // including all states
    text-align: center;

  }

  .react-datepicker-popper .euiFieldText.euiDatePicker {
    // set any subsequent children in popper back to left align
    text-align: left;
  }

  &--inGroup {
    box-shadow: none;
    padding: 0;

    .euiDatePicker {
      height: $euiFormControlHeight - 2px;
    }
  }

  // Direct descendent selectors to override `> span`

  > .euiDatePickerRange__icon {
    flex: 0 0 auto;
    padding-left: $euiFormControlPadding;
    padding-right: $euiFormControlPadding;
  }

  > .euiDatePickerRange__delimeter {
    line-height: 1 !important;
    flex: 0 0 auto;
    padding-left: $euiFormControlPadding / 2;
    padding-right: $euiFormControlPadding / 2;
  }
}

.euiDatePickerRange--readOnly {
  background: $euiFormBackgroundDisabledColor;
}

.euiDatePopoverButton {
  @include euiSuperDatePickerText;
  background-size: 100%; // For the bottom "border" via background-image

  &:focus,
  &-isSelected {
    background-image: euiFormControlGradient();
  }

  &-needsUpdating {
    $backgroundColor: tintOrShade($euiColorSuccess, 90%, 70%);
    $textColor: makeHighContrastColor($euiColorSuccess, $backgroundColor);

    background-color: $backgroundColor;
    color: $textColor;

    &:focus,
    &.euiDatePopoverButton-isSelected {
      background-image: euiFormControlGradient($euiColorSuccess);
    }
  }

  &-isInvalid {
    $backgroundColor: tintOrShade($euiColorDanger, 90%, 70%);
    $textColor: makeHighContrastColor($euiColorDanger, $backgroundColor);

    background-color: $backgroundColor;
    color: $textColor;

    &:focus,
    &.euiDatePopoverButton-isSelected {
      background-image: euiFormControlGradient($euiColorDanger);
    }
  }
}

.euiDatePopoverButton--start {
  text-align: right;
}

.euiDatePopoverButton--end {
  text-align: left;
}

@mixin euiSuperDatePickerText {
  @include euiFormControlText;
  display: block;
  width: 100%;
  padding: 0 $euiSizeS;
  line-height: $euiFormControlHeight - 2px;
  height: $euiFormControlHeight - 2px;
  word-break: break-all;
  transition: background $euiAnimSpeedFast ease-in;
}

.euiDatePopoverContent {
  width: $euiFormMaxWidth;
  max-width: 100%;
}

.euiDatePopoverContent__padded {
  padding: $euiSizeS;
}

.euiDatePopoverContent__padded--large {
  padding: $euiSize;
}

@include euiBreakpoint('xs', 's') {
  .euiDatePopoverContent {
    // Small screens drop the time selector
    width: $euiDatePickerCalendarWidth;
  }
