      margin-top: $euiSize;

      // Make sure the first <dt> doesn't get a margine.
      &:first-of-type {
        margin-top: 0;
      }
    }

    .euiDescriptionList__description {
      @include euiFontSizeS;
    }

    // Lists can be aligned.
    &.euiDescriptionList--center {
      text-align: center;
    }

    &.euiDescriptionList--right {
      text-align: right;
    }

    // Reversed makes the description larger than the title
    &.euiDescriptionList--reverse {
      .euiDescriptionList__title {
        @include euiText;
        @include euiFontSizeS;
      }

      .euiDescriptionList__description {
        @include euiTitle('xs');
      }
    }

    // Compressed gets smaller fonts.
    &.euiDescriptionList--compressed {

      .euiDescriptionList__title {
        @include euiTitle('xxs');
        line-height: $euiLineHeight;
      }

      .euiDescriptionList__description {
        @include euiFontSizeS;
      }

      &.euiDescriptionList--reverse {
        .euiDescriptionList__title {
          @include euiText;
          @include euiFontSizeS;
        }

        .euiDescriptionList__description {
          @include euiTitle('xxs');
          line-height: $euiLineHeight;
        }
      }
    }
  }


  &.euiDescriptionList--column {
    display: flex;
    align-items: stretch;
    flex-wrap: wrap;

    > * {
      margin-top: $euiSize;
    }

    // First two items don't have margin
    > *:first-child,
    > :nth-child(2) {
      margin-top: 0;
    }

    .euiDescriptionList__title {
      @include euiTitle('xs');
      line-height: $euiLineHeight;
      width: 50%; // Flex-basis doesn't work in IE with padding
      padding-right: $euiSizeS;
    }

    .euiDescriptionList__description {
      @include euiFontSize;
      width: 50%; // Flex-basis doesn't work in IE with padding
      padding-left: $euiSizeS;
    }

    // Align the title to smush against the description.
    &.euiDescriptionList--center {

      .euiDescriptionList__title {
        text-align: right;
      }
    }

    &.euiDescriptionList--reverse {
      .euiDescriptionList__title {
        @include euiText;
        @include euiFontSize;
      }

      .euiDescriptionList__description {
        @include euiTitle('xs');
        line-height: $euiLineHeight;
      }
    }

    &.euiDescriptionList--compressed {

      .euiDescriptionList__title {
        @include euiTitle('xxs');
        line-height: $euiLineHeight;
      }

      .euiDescriptionList__description {
        @include euiFontSizeS;
      }

      &.euiDescriptionList--reverse {
        .euiDescriptionList__title {
          @include euiText;
          @include euiFontSizeS;
        }

        .euiDescriptionList__description {
          @include euiTitle('xxs');
          line-height: $euiLineHeight;
        }
      }
    }
  }

  &.euiDescriptionList--inline {

    .euiDescriptionList__title {
      @include euiFontSizeS;
      display: inline;
      border-radius: $euiBorderRadius;
      font-weight: $euiFontWeightRegular;
      background: $euiColorLightestShade;
      border: $euiBorderThin;
      padding:  0 $euiSizeXS;
      margin: 0 $euiSizeXS;

      // Make sure the first <dt> doesn't get a margine.
      &:first-of-type {
        margin-left: 0;
      }
    }

    .euiDescriptionList__description {
      @include euiFontSizeS;
      display: inline;
      word-break: break-all;
    }

    // Compressed when inline is even smaller.
    &.euiDescriptionList--compressed {

      .euiDescriptionList__title {
        @include euiFontSizeXS;
      }

      .euiDescriptionList__description {
        @include euiFontSizeXS;
      }
    }

    &.euiDescriptionList--center {
      text-align: center;
    }
  }

}

