  @each $fraction, $map in $fractions {
    .euiFlexGrid--#{$gutterName}.euiFlexGrid--#{$fraction} {
      > .euiFlexItem {
        flex-basis: calc(#{map-get($map, 'percentage')} - #{$gutterSize});
      }

      &.euiFlexGrid--directionColumn { /* 1 */
        column-count: map-get($map, 'count');

