// Create level modifiers based upon the map.
@each $name, $color in $euiRangeLevelColors {
  .euiRangeLevel--#{$name} {
    background-color: transparentize($color, .7);
  }
}

/*
 *  Input Range Customization by browser
 */

// The following code is inspired by...

// Github: https://github.com/darlanrod/input-range-sass
// Author: Darlan Rod https://github.com/darlanrod
// Version 1.4.1
// MIT License

// It has been modified to fit the styling patterns of Kibana and
// to be more easily maintained / themeable going forward.

.euiRangeSlider {
  // Auto means the height isn't defined
  height: $euiFormControlHeight;
  appearance: none;
  background: transparent; // Otherwise white in Chrome
  width: 100%; // ensures the slider expands to fill flex display
  position: relative;
  z-index: $euiZLevel2; // stay above tick marks
  cursor: pointer; // Keep cursor to full range bounds

  &:disabled {
    cursor: not-allowed;

    // sass-lint:disable-block mixins-before-declarations
    @include euiRangeThumbPerBrowser {
      cursor: not-allowed;
      border-color: $euiRangeThumbBorderColor;
      background-color: $euiRangeThumbBorderColor;
      box-shadow: none;
    }

    ~ .euiRangeThumb {
      cursor: not-allowed;
      border-color: $euiRangeThumbBorderColor;
      background-color: $euiRangeThumbBorderColor;
      box-shadow: none;
    }
  }

  @include euiRangeThumbPerBrowser {
    @include euiCustomControl($type: 'round');
    @include euiRangeThumbStyle;
  }

  @include euiRangeTrackPerBrowser {
    @include euiRangeTrackSize;
    background: $euiRangeTrackColor;
    border: $euiRangeTrackBorderWidth solid $euiRangeTrackBorderColor;
    border-radius: $euiRangeTrackRadius;
  }

  &:focus,
  &--hasFocus {
    @include euiRangeThumbPerBrowser {
      @include euiCustomControlFocused;
    }

    ~ .euiRangeThumb {
      border-color: $euiColorPrimary;
    }

    @include euiRangeTrackPerBrowser {
      background-color: $euiColorPrimary;
      border-color: $euiColorPrimary;
    }

    ~ .euiRangeHighlight .euiRangeHighlight__progress {
      background-color: $euiColorPrimary;
    }

    ~ .euiRangeTooltip .euiRangeTooltip__value {
      @include euiBottomShadowMedium;

      &.euiRangeTooltip__value--right,
      &.euiRangeTooltip__value--left {
        transform: translateX(0) translateY(-50%) scale(1.1);
      }
    }
  }

  // Resets

  // Disable linter for these very unique vendor controls
  // sass-lint:disable-block no-vendor-prefixes
  &::-webkit-slider-thumb {
    -webkit-appearance: none;
    margin-top: ((-$euiRangeTrackBorderWidth * 2 + $euiRangeTrackHeight) / 2) - ($euiRangeThumbHeight / 2);
  }

  &::-ms-thumb {
    margin-top: 0;
  }

  &::-moz-focus-outer {
    border: none;
  }

  &::-ms-track {
    @include euiRangeTrackSize;
    background: transparent;
    border-color: transparent;
    border-width: ($euiRangeThumbHeight / 2) 0;
    color: transparent;
  }

  // States
  &--hasTicks {
    height: $euiFormControlHeight / 2; // Adjust vertical alignment based on extras
  }
}

// Lighten the track when showing the range
.euiRangeSlider--hasRange {
  @include euiRangeTrackPerBrowser {
    background-color: transparentize($euiRangeTrackColor, .6);
    border-color: transparentize($euiRangeTrackBorderColor, .6);
  }
}

.euiRangeThumb {
  @include euiCustomControl($type: 'round');
  @include euiRangeThumbStyle;
  content: '';
  position: absolute;
  left: 0;
  top: 50%;
  margin-top: -($euiRangeThumbHeight / 2);
  z-index: $euiZLevel2;
  pointer-events: none;

  &:focus {
    @include euiCustomControlFocused;
  }

  &--hasTicks {
    top: 25%;
  }
}

.euiRangeTicks {
  position: absolute;
  left: ($euiRangeThumbWidth / 2);
  right: ($euiRangeThumbWidth / 2);
  top: $euiSizeS;
  display: flex;
  z-index: $euiZLevel1;
}

.euiRangeTick {
  overflow-x: hidden;
  text-overflow: ellipsis;
  font-size: $euiFontSizeXS;
  position: relative;
  padding-top: $euiSize;

  &::before {
    @include size($euiSizeXS);

    content: '';
    background-color: $euiColorDarkShade;
    border-radius: 100%;
    position: absolute;
    top: 0;
    left: calc(50% - #{($euiSizeXS/2)});
  }

  &--isCustom {
    position: absolute;
    transform: translateX(-50%);
  }

  &:enabled:hover,
  &:focus,
  &--selected {
    color: $euiColorPrimary;
  }

  &--selected {
    font-weight: $euiFontWeightMedium;
  }

  &:disabled {
    cursor: not-allowed;
  }
}

.euiRangeTooltip {
  // Keeps tooltip (value) aligned to percentage of actual slider
  display: block;
  position: absolute;
  left: 0;
  top: 0;
  bottom: 0;
  width: calc(100% - #{$euiRangeThumbWidth});
  margin-left: $euiRangeThumbWidth / 2;
}

.euiRangeTooltip__value {
  // Indentation for legibility in transition
  // sass-lint:disable-block indentation
  @include euiFontSizeS;
  border: 1px solid transparentize($euiColorDarkestShade, .8);
  position: absolute;
  border-radius: $euiBorderRadius;
  padding: ($euiSizeXS / 2) $euiSizeS;
  background-color: tintOrShade($euiColorFullShade, 25%, 90%);
  color: $euiColorGhost;
  max-width: 256px;
  z-index: $euiZLevel4;
  top: ($euiFormControlHeight / 2) - 1px;
  transition:
    box-shadow $euiAnimSpeedNormal $euiAnimSlightResistance,
    transform $euiAnimSpeedNormal $euiAnimSlightResistance;

  // Custom sizing
  $arrowSize: $euiSizeM;
  $arrowMinusSize: (($arrowSize / 2) - 1px) * -1;

  &::after,
  &::before {
    content: '';
    position: absolute;
    bottom: -$arrowSize / 2;
    left: 50%;
    transform-origin: center;
    background-color: tintOrShade($euiColorFullShade, 25%, 90%);
    width: $arrowSize;
    height: $arrowSize;
    border-radius: 2px;
  }

  &::before {
    background-color: transparentize($euiColorDarkestShade, .8);
  }

  // Positions the arrow
  &.euiRangeTooltip__value--right {
    margin-left: $euiSizeL;

    &:before,
    &:after {
      left: $arrowMinusSize;
    }

    &::before {
      margin-left: -1px;
    }
  }

  &.euiRangeTooltip__value--left {
    margin-right: $euiSizeL;

    &:before,
    &:after {
      left: auto;
      right: $arrowMinusSize;
    }

    &::before {
      margin-right: -1px;
    }
  }

  &.euiRangeTooltip__value--right,
  &.euiRangeTooltip__value--left {
    transform: translateX(0) translateY(-50%);

    &:before,
    &:after {
      bottom: 50%;
      transform: translateY(50%) rotateZ(45deg);
    }
  }

  &--hasTicks {
    top: ($euiFormControlHeight / 4) - 1px;
  }
}

.euiRangeTrack {
  height: 100%; // Don't overflow `euiRangeWrapper`
  flex-grow: 1;
  position: relative; // for positioning ticks/levels
  align-self: flex-start; // Adjust vertical alignment of input based on extras

  &--disabled {
    opacity: $euiRangeDisabledOpacity;
  }
}

/*
 * 1. There's no way to target the layout of the extra input, so we must
 *    use the descendant selector to allow the width to shrink.
 */

.euiRangeWrapper {
  @include euiFormControlSize;
  display: flex;
  align-items: center;

  &--fullWidth {
    max-width: 100%;
  }

  > .euiFormControlLayout { /* 1 */
    width: auto;
  }
}

.euiDualRange {
  &__slider {
    @include euiRangeThumbPerBrowser {
      visibility: hidden;
    }
  }
}

/**
 * 1. Leave room for caret.
 * 2. Ensure the descenders don't get cut off
 */

.euiSelect {
  @include euiFormControlStyle;
  @include euiFormControlWithIcon($side: 'right'); /* 1 */
  @include euiFormControlIsLoading($isNextToIcon: true);

  appearance: none;
  line-height: $euiFormControlHeight; /* 2 */
  padding-top: 0; /* 2 */
  padding-bottom: 0; /* 2 */

  &--compressed {
    line-height: $euiFormControlCompressedHeight; /* 2 */
    padding-top: 0; /* 2 */
    padding-bottom: 0; /* 2 */
  }

  &--inGroup {
    line-height: $euiFormControlHeight - 2px; /* 2 */
  }

  &--inGroup#{&}--compressed {
    line-height: $euiFormControlCompressedHeight - 2px; /* 2 */
  }

  // Turn off linter for some MS specific bits.
  // sass-lint:disable no-vendor-prefixes
  &::-ms-expand {
    display: none;
  }

  &:focus::-ms-value {
    color: $euiTextColor;
    background: transparent;
  }
}

/*
 * 1. Make popover the same width as the form control
 * 2. Style popover similar to combobox
 * 3. Use attribute selector to match popover position without needing the full popover class name
 */

.euiSuperSelect {
  &:not(.euiSuperSelect--fullWidth) { /* 1 */
    // sass-lint:disable-block no-important
    max-width: $euiFormMaxWidth !important; // override default popover styles
  }
}

.euiSuperSelect__popoverPanel[class*='bottom'] { /* 3 */
  border-top-color: transparentize($euiBorderColor, .2);
  border-top-right-radius: 0; /* 2 */
  border-top-left-radius: 0; /* 2 */
}

.euiSuperSelect__popoverPanel[class*='top'] { /* 3 */
  @include euiBottomShadowFlat; /* 2 */

  border-bottom-color: transparentize($euiBorderColor, .2);
  border-bottom-right-radius: 0; /* 2 */
  border-bottom-left-radius: 0; /* 2 */
}

.euiSuperSelect__item {
  &:hover,
  &:focus {
    text-decoration: none;
    background-color: $euiFocusBackgroundColor;
  }
}

.euiSuperSelect__item--hasDividers:not(:last-of-type) {
  border-bottom: $euiBorderThin;
}

/**
 * 1. Leave room for caret.
 * 2. Ensure the descenders don't get cut off
 * 3. Makes sure the height is correct when there's no selection
 */

.euiSuperSelectControl {
  @include euiFormControlStyle;
  @include euiFormControlWithIcon($side: 'right'); /* 1 */
  @include euiFormControlIsLoading($isNextToIcon: true);

  display: block; /* 3 */
  text-align: left;
  line-height: $euiFormControlHeight; /* 2 */
  padding-top: 0; /* 2 */
  padding-bottom: 0; /* 2 */
  // Truncate the text
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;

  &-isInvalid {
    @include euiFormControlInvalidStyle;
  }

  &--compressed {
    line-height: $euiFormControlCompressedHeight; /* 2 */
    padding-top: 0; /* 2 */
    padding-bottom: 0; /* 2 */
  }

  &.euiSuperSelect--isOpen__button { // since this is a button, we also want the visual indicator of active when options are shown
    @include euiFormControlFocusStyle;
  }
}

.euiSwitch {
  position: relative;
  display: inline-block;
  min-height: $euiSwitchHeight;

  .euiSwitch__label {
    padding-left: $euiSizeS;
    line-height: $euiSwitchHeight;
    font-size: $euiFontSizeS;
    vertical-align: middle;
  }

  /**
   * 1. The input is "hidden" but still focusable.
   * 2. Make sure it's still hidden when [disabled].
   */
  .euiSwitch__input,
  .euiSwitch__input[disabled] /* 2 */ {
    position: absolute;
    opacity: 0; /* 1 */
    width: 100%;
    height: 100%;
    cursor: pointer;
  }

  .euiSwitch__input:focus + .euiSwitch__body {

    .euiSwitch__thumb {
      @include euiCustomControlFocused;
    }
  }

  .euiSwitch__body {
    pointer-events: none;
    width: $euiSwitchWidth;
    height: $euiSwitchHeight;
    background-color: $euiColorPrimary;
    display: inline-block;
    position: relative;
    border-radius: $euiSwitchHeight;
    vertical-align: middle;
  }

  .euiSwitch__thumb {
    @include euiCustomControl($type: 'round', $size: $euiSwitchThumbSize);

    position: absolute;
    display: inline-block;
    left: $euiSwitchWidth - $euiSwitchThumbSize;
    transition: border-color $euiAnimSpeedNormal $euiAnimSlightBounce, background-color $euiAnimSpeedNormal $euiAnimSlightBounce, left $euiAnimSpeedNormal $euiAnimSlightBounce, transform $euiAnimSpeedNormal $euiAnimSlightBounce;
  }

  .euiSwitch__track {
    position: absolute;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    overflow: hidden;
    border-radius: $euiSwitchHeight;
  }

  .euiSwitch__icon {
    position: absolute;
    right: -($euiSwitchWidth - ($euiSwitchThumbSize / 2));
    top: ($euiSwitchHeight - $euiSwitchIconHeight) / 2;
    bottom: 0;
    width: $euiSwitchWidth - ($euiSwitchThumbSize / 2) + $euiSizeS;
    height: $euiSwitchIconHeight;
    transition: left $euiAnimSpeedNormal $euiAnimSlightBounce, right $euiAnimSpeedNormal $euiAnimSlightBounce;
    fill: $euiTextColor;
  }

  .euiSwitch__icon--checked {
    right: auto;
    left: -$euiSizeS;
    fill: $euiColorEmptyShade;
  }

  /**
   * The thumb is slightly scaled when in use, unless it's disabled.
   */
  &:hover {
    .euiSwitch__input:not(:disabled) ~ .euiSwitch__body {
      .euiSwitch__thumb {
        transform: scale(1.05);
      }
    }
  }

  &:active {
    .euiSwitch__thumb {
      transform: scale(.95);
    }
  }

  .euiSwitch__input:disabled:hover {
    cursor: not-allowed;
  }

  .euiSwitch__input:disabled ~ .euiSwitch__body,
  .euiSwitch__input:checked:disabled ~ .euiSwitch__body {
    background-color: lightOrDarkTheme(transparentize($euiColorMediumShade, .8), transparentize($euiColorMediumShade, .3));

    .euiSwitch__thumb {
      @include euiCustomControlDisabled;
      background-color: lightOrDarkTheme(transparentize($euiColorMediumShade, .8), transparentize($euiColorMediumShade, .3));
    }

    .euiSwitch__icon {
      fill: $euiFormCustomControlDisabledIconColor;
    }

    + label {
      color: $euiFormControlDisabledColor;
    }
  }

  .euiSwitch__input:not(:checked):not(:disabled) ~ .euiSwitch__body {
    background-color: lightOrDarkTheme(transparentize($euiColorMediumShade, .8), transparentize($euiColorMediumShade, .3));
  }

  /**
   * When input is not checked, we shift around the positioning of sibling/child selectors.
   */
  .euiSwitch__input:not(:checked) ~ .euiSwitch__body {
    .euiSwitch__thumb {
      left: 0;
    }

    .euiSwitch__icon {
      right: -$euiSizeS;

      &.euiSwitch__icon--checked {
        right: auto;
        left: -($euiSwitchWidth - ($euiSwitchThumbSize / 2));
      }
    }
  }
}

.euiTextArea {
  @include euiFormControlStyle;
  line-height: $euiLineHeight; // give more spacing between multiple lines

  // Textareas have their own sizing
  &,
  &--compressed {
    height: auto;
  }
}

// resize modifiers
$textareaResizing: (
  vertical: 'resizeVertical',
  horizontal: 'resizeHorizontal',
  both: 'resizeBoth',
  none: 'resizeNone',
);

// Create button modifiders based upon the map.
@each $direction, $modifier in $textareaResizing {
  .euiTextArea--#{$modifier} {
    resize: #{$direction};
  }
}

// Header. Includes breadcrumbs of nav buttons.

.euiHeader {
  @include euiBottomShadowSmall;

  position: relative;
  z-index: $euiZHeader; // ensure the shadow shows above content
  display: flex;
  background: $euiHeaderBackgroundColor;
  border-bottom: $euiBorderThin;
}

.euiHeaderProfile {
  padding: $euiSize;
}

@import '../../link/mixins';

.euiHeaderLinks {
  display: flex;
  justify-content: space-between;
  position: relative;
  flex-grow: 1;
}

.euiHeaderLinks__list {
  white-space: nowrap;
  overflow: hidden;
}

.euiHeaderLinks__mobile {
  // sass-lint:disable-block no-important
  display: none !important; // override popover inline-block
  position: absolute !important; // override popover relative
  right: 0;

}

@include euiBreakpoint('xs', 's') {
  // sass-lint:disable-block no-important
  .euiHeaderLinks__mobile {
    display: block !important;
  }

  .euiHeaderLinks__list {
    display: none;
  }
}

.euiHeaderLink {
  @include euiLink;
  display: inline-block;
  height: $euiHeaderChildSize;
  line-height: $euiHeaderChildSize;
  padding: 0 $euiSizeS;
  text-align: left;
}

.euiHeaderLinks__mobileList {
  .euiHeaderLink {
    display: block;
    height: auto;
    line-height: $euiLineHeight;
    padding: $euiSizeS;

    // EuiButtons normally center, which macks sense. In mobile though we want
    // them to align left. This is a safe hack given the specificity.
    > span {
      justify-content: flex-start;
    }
  }
}

@mixin euiLink {
  text-align: left;

  &:hover {
    text-decoration: underline;
  }

  &:focus {
    text-decoration: underline;
    background: $euiFocusBackgroundColor;
  }
}

// Note - these are also used by the EuiNavDrawer (/nav_drawer) component
// Themable colors
$euiHeaderBackgroundColor: $euiColorEmptyShade;
$euiHeaderBreadcrumbColor: $euiColorDarkestShade;

// Layout vars
$euiHeaderChildSize: $euiSizeXXL + $euiSizeS;

@import '../link/mixins';

.euiHeaderLogo {
  @include euiLink;

  position: relative;
  height: $euiHeaderChildSize;
  line-height: $euiHeaderChildSize;
  min-width: $euiHeaderChildSize + 1px;
  padding: 0 ($euiSizeM + 1px) 0 $euiSizeM;
  display: inline-block;
  vertical-align: middle;
  white-space: nowrap;

  &:focus,
  &:hover {
    text-decoration: none;
  }
}

.euiHeaderLogo__icon {
  opacity: 1;
  position: relative;
  top: -2px;
}

.euiHeaderLogo__text {
  @include euiTitle('s');
  padding-left: $euiSize;
  font-weight: $euiFontWeightLight;
}

@include euiBreakpoint('xs') {
  .euiHeaderLogo {
    padding: 0 $euiSizeM;
  }

  .euiHeaderLogo__icon.euiIcon--xLarge {
    width: $euiSizeL;
    height: $euiSizeL;
  }

  .euiHeaderLogo__text {
    @include euiTitle('xs');
    font-weight: $euiFontWeightRegular;
  }
}

.euiHeaderAlert {
  min-width: 300px;
  position: relative;
  padding: $euiSize;
  border-top: $euiBorderThin;

  .euiHeaderAlert__dismiss {
    opacity: 0;
    position: absolute;
    right: $euiSize - 4px;
    top: $euiSize - 4px;
    transition: opacity $euiAnimSpeedNormal ease-in;
  }

  &:hover .euiHeaderAlert__dismiss,
  .euiHeaderAlert__dismiss:focus {
    opacity: 1;
  }

  .euiHeaderAlert__title {
    @include euiTitle('xs');
    padding-right: $euiSizeL; // Accounts for the dismiss button.
  }

  .euiHeaderAlert__text {
    @include euiFontSizeXS;
    margin-bottom: $euiSizeS;
  }

  .euiHeaderAlert__action {
    @include euiFontSizeXS;
  }

  .euiHeaderAlert__date {
    @include euiFontSizeXS;
    color: $euiColorDarkShade;
  }
}

// Breadcrumb navigation included in the header.

@import '../../link/mixins';

.euiHeaderBreadcrumbs {
  margin-left: $euiSize;
  margin-right: $euiSize;
  display: flex;
  align-items: center;
  flex-grow: 1;
}

@include euiBreakpoint('xs') {
  .euiHeaderBreadcrumbs {
    margin-left: $euiSizeS;
    margin-right: $euiSizeS;
  }
}

.euiHeaderSection {
  display: flex;
  flex-grow: 0;
  flex-shrink: 0;
}

.euiHeaderSection--grow,
.euiHeaderSection--left {
  flex-grow: 1;
}

.euiHeaderSection--dontGrow {
  flex-grow: 0;
}

// Header items are the small icon links that pop up menus.

.euiHeaderSectionItem {
  position: relative;

  &:hover {
    background: $euiColorLightestShade;
  }

  &:after {
    position: absolute;
    content: '';
    top: $euiSize;
    bottom: 0;
    background: $euiBorderColor;
    left: 0;
  }
}

.euiHeaderSectionItem__button {
  height: $euiHeaderChildSize;
  min-width: $euiHeaderChildSize;
  text-align: center;
  font-size: 0; // aligns icons better vertically

  &:focus {
    background: $euiFocusBackgroundColor;
  }
}

.euiHeaderSectionItem--borderLeft {
  &:after {
    left: 0;
    width: 1px;
  }
}

.euiHeaderSectionItem--borderRight {
  &:after {
    width: 1px;
    left: auto;
    right: 0;
  }
}

.euiHeaderNotification {
  position: absolute;
  top: 9%;
  right: 9%;
  box-shadow: 0 0 0 1px $euiHeaderBackgroundColor;
}

@include euiBreakpoint('xs') {
  .euiHeaderSectionItem,
  .euiHeaderSectionItem__button {
    min-width: $euiHeaderChildSize * .75;
  }

  .euiHeaderSectionItem--borderLeft,
  .euiHeaderSectionItem--borderRight {
    &:after {
      display: none;
    }
  }

  // On small screens just show a small dot indicating there are notifications
  .euiHeaderNotification {
    @include size($euiSizeS);
    top: 20%;
    min-width: 0;
    border-radius: $euiSizeS;
    color: $euiColorAccent;
    overflow: hidden;
  }
}

.euiHealth {
  @include euiFontSizeS;
  display: inline-block;
}

.euiHorizontalRule {
  border: none;
  // Sometimes Chrome "calculates" an element height of e.g. 0.990px, which it
  // rounds down, thereby hiding the element.
  height: 1.1px;
  background-color: $euiBorderColor;

  &.euiHorizontalRule--full {
    width: 100%;
  }

  &.euiHorizontalRule--half {
    width: 50%;
    margin-left: auto;
    margin-right: auto;
  }

  &.euiHorizontalRule--quarter {
    width: 25%;
    margin-left: auto;
    margin-right: auto;
  }
}

$ruleMargins: (
  marginXSmall: $euiSizeS,
  marginSmall: $euiSizeM,
  marginMedium: $euiSize,
  marginLarge: $euiSizeL,
  marginXLarge: $euiSizeXL,
  marginXXLarge: $euiSizeXXL,
);

@each $name, $size in $ruleMargins {
  .euiHorizontalRule--#{$name} {
    margin: $size 0;
  }
}

.euiIcon {
  flex-shrink: 0; // Ensures it never scales down below it's intended size
  display: inline-block;
  vertical-align: middle;
  fill: currentColor;
  transform: translate(0, 0); // Hack to fix Firefox "softness"

  &:focus {
    opacity: 1; // We often hide icons on hover. Make sure they appear on focus.
    background: $euiFocusBackgroundColor;
  }
}

// App icons are two-toned so get an extra class. This provides the base color.
.euiIcon--app {
  fill: $euiTextColor;

  // This provides the default secondary color
  .euiIcon__fillSecondary {
    fill: $euiColorSecondary;
  }
}

.euiIcon-isLoading {
  opacity: $euiIconLoadingOpacity;
  background-color: currentColor;
  border-radius: $euiBorderRadius;
}

.euiIcon-isLoaded {
  animation: euiIconLoading $euiAnimSpeedNormal ease-in 0s 1 forwards;
}

// COLORS

@each $name, $color in $euiIconColors {
  .euiIcon--#{$name} {
    // Use color attribute so currentColor can be used in more properties
    color: $color;
  }
}

// App icon special cases for fully mono
.euiIcon--text,
.euiIcon--subdued,
.euiIcon--primary {
  &,
  .euiIcon__fillSecondary {
    fill: currentColor;
  }
}

// Use the negative fill on SVG elements that need to flip portions
// of the icon to light and dark compatible modes. You can see this
// in use on the Elastic logo icons.
.euiIcon__fillNegative {
  fill: $euiColorDarkestShade;
}

// SIZES

@each $name, $size in $euiIconSizes {
  .euiIcon--#{$name} {
    @include size($size);
  }
}

@keyframes euiIconLoading {
  0% {
    opacity: $euiIconLoadingOpacity;
  }

  100% {
    opacity: 1;
  }
}

$euiIconLoadingOpacity: .05;

// Modifier naming and colors.

$euiIconColors: (
  text: $euiTextColor,
  primary: $euiColorPrimary,
  subdued: $euiColorMediumShade,
  secondary: $euiColorSecondary,
  success: $euiColorSuccess,
  accent: $euiColorAccent,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
  ghost: $euiColorGhost,
);

$euiIconSizes: (
  small: $euiSizeM,
  medium: $euiSize,
  large: $euiSizeL,
  xLarge: $euiSizeXL,
  xxLarge: $euiSizeXXL
);

/**
 * 1. Fix for IE where the image correctly resizes in width but doesn't collapse it's height
      (https://github.com/philipwalton/flexbugs/issues/75#issuecomment-134702421)
 */

// Main <figure> that wraps images.
.euiImage {
  display: inline-block;
  max-width: 100%;
  position: relative;
  min-height: 1px; /* 1 */
  line-height: 0; // Fixes cropping when image is resized by forcing it's height to be determined by the image not line-height

  &.euiImage--hasShadow {
    .euiImage__img {
      @include euiBottomShadowMedium;
    }
  }

  &.euiImage--allowFullScreen:hover {
    .euiImage__img {
      cursor: pointer;
    }

    .euiImage__icon {
      visibility: visible;
      opacity: 1;
    }
  }

  // These sizes are mostly suggestions. Don't look too hard for meaning in their values.
  &.euiImage--small {
    width: convertToRem(120px);
  }

  &.euiImage--medium {
    width: convertToRem(200px);
  }

  &.euiImage--large {
    width: convertToRem(360px);
  }

  &.euiImage--xlarge {
    width: convertToRem(600px);
  }

  &.euiImage--fullWidth {
    width: 100%;
  }
}

// The image itself is full width within the container.
.euiImage__img {
  width: 100%;
}

.euiImage__caption {
  @include euiFontSizeS;
  text-align: center;
}

.euiImage__icon {
  visibility: hidden;
  opacity: 0;
  position: absolute;
  right: $euiSize;
  top: $euiSize;
  transition: opacity $euiAnimSpeedSlow $euiAnimSlightResistance ;
  cursor: pointer;
}

// The FullScreen image that optionally pops up on click.
.euiImageFullScreen {
  max-height: 80vh;
  max-width: 80vw;
  animation: euiImageFullScreen $euiAnimSpeedExtraSlow $euiAnimSlightBounce;

  .euiImageFullScreen__img {
    max-height: 80vh;
    max-width: 80vw;
    cursor: pointer;
  }

  &:hover .euiImageFullScreen__img {
    cursor: pointer;
  }
}


@keyframes euiImageFullScreen {
  0% {
    opacity: 0;
    transform: translateY($euiSizeXL * 2);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

/**
 * Dial menu is a phone like dial comprised of an svg icon and a title.
 */

/**
 * 1. Default to grid of 3
 */
.euiKeyPadMenu {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  width: $euiKeyPadMenuSize * 3;
}

/**
 * 1. If this class is applied to a button, we need to override the Chrome default font.
 * 2. If it has a BetaBadge, make sure only the first letter shows
 */
.euiKeyPadMenuItem {
  @include euiFont; /* 1 */
  // Disable indentation for transition legibility
  // sass-lint:disable-block indentation
  display: block;
  padding: $euiSizeXS;
  height: $euiKeyPadMenuSize;
  width: $euiKeyPadMenuSize;
  color: $euiColorDarkShade;
  border: $euiBorderThin;
  border-color: transparent;
  border-radius: $euiBorderRadius;
  transition:
    border-color $euiAnimSpeedFast ease-in,
    box-shadow $euiAnimSpeedFast ease-in;

  &:hover,
  &:focus {
    @include euiSlightShadow;
    border-color: $euiBorderColor;

    .euiKeyPadMenuItem__icon {
      transform: translateY(0);
    }
  }
}

.euiKeyPadMenuItem__inner {
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;

  .euiKeyPadMenuItem--hasBetaBadge & {
    position: relative;

    .euiKeyPadMenuItem__betaBadgeWrapper {
      position: absolute;
      top: $euiSizeS;
      right: $euiSizeS;
      z-index: 3;

      // sass-lint:disable-block nesting-depth
      .euiKeyPadMenuItem__betaBadge:not(.euiBetaBadge--iconOnly) {
        width: $euiSizeL;
        padding: 0 (($euiSizeL - $euiFontSizeXS) / 1.5);  /* 2 */
        overflow: hidden;  /* 2 */
        letter-spacing: 3rem;  /* 2 */
      }
    }
  }
}

.euiKeyPadMenuItem__icon {
  transition: transform $euiAnimSpeedNormal $euiAnimSlightBounce;
  transform: translateY(2px);
  margin-bottom: $euiSizeM;
}

.euiKeyPadMenuItem__label {
  font-size: $euiFontSizeXS;
  font-weight: $euiFontWeightMedium;
  line-height: $euiSize;
  text-align: center;
}

// Key padis a phone like nav comprised of an svg icon and a title.

$euiKeyPadMenuSize: $euiSize * 6;

@import 'key_pad_menu';

.euiLink {
  @include euiLink;
}

$textColors: (
  subdued: $euiColorDarkShade,
  primary: $euiColorPrimary,
  secondary: $euiColorSecondary,
  accent: $euiColorAccent,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
  text: $euiTextColor,
  ghost: $euiColorGhost,
);

// Create color modifiers based on the map
@each $name, $color in $textColors {
  .euiLink.euiLink--#{$name} {
    color: $color;

    &:hover {
      color: darken($color, 10%);
    }

    &:focus {
      outline: solid 3px transparentize($color, .9);
      background-color: transparentize($color, .9);
    }
  }
}

/**
 * The List Group component provides neatly styled lists containing plain text
 * or links. The outer container can be bordered, with padding, or borderless
 * with links flush to the sides.
 *(
 * List items can be displayed with active and disabled states.
 */

.euiListGroup {
  padding: $euiSizeS;

  &.euiListGroup-flush {
    padding: 0;
    border: none;
  }

  &.euiListGroup-bordered {
    border-radius: $euiBorderRadius;
    border: $euiBorderThin;
  }
}

.euiListGroup-maxWidthDefault {
  max-width: $euiFormMaxWidth;
}

.euiListGroupItem {
  padding: 0;
  margin-top: $euiSizeS;
  border-radius: $euiBorderRadius;
  overflow: hidden;
  display: flex;
  align-items: center;
  transition: background-color $euiAnimSpeedFast;
  position: relative;

  &:first-child {
    margin-top: 0;
  }

  &.euiListGroupItem-isActive,
  &.euiListGroupItem-isClickable:hover,
  &.euiListGroupItem-isClickable:focus {
    background-color: tintOrShade($euiColorLightestShade, 0%, 30%);
  }

  &.euiListGroupItem-isClickable:hover .euiListGroupItem__label,
  &.euiListGroupItem-isClickable:focus .euiListGroupItem__label {
    text-decoration: underline;
  }

  // Style all disabled list items whether or not they are links or buttons
  &.euiListGroupItem-isDisabled,
  &.euiListGroupItem-isDisabled:hover,
  &.euiListGroupItem-isDisabled:focus,
  &.euiListGroupItem-isDisabled .euiListGroupItem__button:hover,
  &.euiListGroupItem-isDisabled .euiListGroupItem__button:focus {
    color: $euiButtonColorDisabled;
    text-decoration: none;
    cursor: not-allowed;
    background-color: transparent;
  }
}

.euiListGroupItem__text,
.euiListGroupItem__button {
  padding: $euiSizeS;
  display: flex;
  align-items: center;
  flex: 1 0 auto; // The flex-shrink and flex-basis values are needed for IE11
  text-align: left;
  max-width: 100%;

  .euiListGroupItem-hasExtraAction & {
    max-width: calc(100% - #{$euiSizeXL});
  }
}

.euiListGroupItem__label {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.euiListGroupItem__extraAction {
  opacity: 0;
  margin-right: $euiSizeS;
  transition: opacity $euiAnimSpeedFast;

  .euiListGroupItem:not(.euiListGroupItem-isDisabled):focus &,
  .euiListGroupItem:not(.euiListGroupItem-isDisabled):hover &,
  &.euiListGroupItem__extraAction-alwaysShow,
  &:focus {
    opacity: 1;
  }
}

.euiListGroupItem__icon {
  margin-right: $euiSizeM;
  flex-grow: 0;
  flex-shrink: 0;
}

.euiListGroupItem--xSmall {
  font-size: $euiFontSizeXS;
  line-height: $euiSizeM;
}

.euiListGroupItem--small {
  font-size: $euiFontSizeS;
  line-height: $euiSize;
}

.euiListGroupItem--large {
  font-size: $euiFontSizeL;
  line-height: $euiSize;
}

.euiListGroupItem--wrapText {
  .euiListGroupItem__button,
  .euiListGroupItem__text {
    width: 100%;
    word-break: break-word;
  }

  .euiListGroupItem__label {
    white-space: inherit;
  }
}

// Layout alts from euiListGroup

.euiListGroup-flush .euiListGroupItem {
  border-radius: 0;
}

.euiListGroup-bordered .euiListGroupItem {
  &:first-child {
    border-top-left-radius: $euiBorderRadius;
    border-top-right-radius: $euiBorderRadius;
  }

  &:last-child {
    border-bottom-left-radius: $euiBorderRadius;
    border-bottom-right-radius: $euiBorderRadius;
  }
}

.euiListGroupItem__tooltip {
  width: 100%;
}

.euiLoadingKibana {
  position: relative;
  display: inline-block;

  &:before,
  &:after {
    position: absolute;
    content: '';
    width: 90%;
    left: 5%;
    border-radius: 50%;
    opacity: .2;
    z-index: 1;
  }

  &:before {
    box-shadow: 0 0 8px $euiColorFullShade;
    animation: 1s euiLoadingKibanaPulsateAndFade $euiAnimSlightResistance infinite;
  }

  &:after {
    background-color: $euiColorFullShade;
    animation: 1s euiLoadingKibanaPulsate $euiAnimSlightResistance infinite;
  }

  .euiLoadingKibana__icon {
    display: block;
  }
}

/**
 * 1. Requires pixel math for animation.
 */
.euiLoadingKibana--medium {
  width: $euiSize;

  &:before,
  &:after {
    height: $euiSizeXS - 1; /* 1 */
    bottom: -$euiSizeXS;
  }

  .euiLoadingKibana__icon {
    z-index: 999;
    animation: 1s euiLoadingKibanaBounceMedium $euiAnimSlightResistance infinite;
  }
}

/**
 * 1. Requires pixel math for animation.
 */
.euiLoadingKibana--large {
  width: $euiSizeL;

  &:before,
  &:after {
    height: $euiSizeS - 2; /* 1 */
    bottom: -$euiSizeS;
  }

  .euiLoadingKibana__icon {
    animation: 1s euiLoadingKibanaBounceLarge $euiAnimSlightResistance infinite;
  }
}

.euiLoadingKibana--xLarge {
  width: $euiSizeXL;

  &:before,
  &:after {
    height: $euiSizeS;
    bottom: -$euiSizeM;
  }

  .euiLoadingKibana__icon {
    animation: 1s euiLoadingKibanaBounceXLarge $euiAnimSlightResistance infinite;
  }
}

@keyframes euiLoadingKibanaBounceMedium {
  50% {
    transform: translateY(-$euiSizeS);
  }
}

@keyframes euiLoadingKibanaBounceLarge {
  50% {
    transform: translateY(-$euiSizeM);
  }
}

@keyframes euiLoadingKibanaBounceXLarge {
  50% {
    transform: translateY(-$euiSize);
  }
}

@keyframes euiLoadingKibanaPulsateAndFade {
  0% {
    opacity: 0;
  }

  50% {
    transform: scale(.5);
    opacity: .1;
  }

  100% {
    opacity: 0;
  }
}

@keyframes euiLoadingKibanaPulsate {
  0% {
    opacity: .15;
  }

  50% {
    transform: scale(.5);
    opacity: .05;
  }

  100% {
    opacity: .15;
  }
}

.euiLoadingChart {
  height: $euiSizeXL;
  z-index: 500;
  overflow: hidden;
  display: inline-block;
}

.euiLoadingChart__bar {
  height: 100%;
  width: $euiSizeS;
  display: inline-block;
  margin-bottom: -$euiSize;
  margin-left: $euiSizeXS / 2;
  animation: euiLoadingChart 1s infinite;

  &:nth-child(1) {
    background-color: $euiColorPrimary;
  }

  &:nth-child(2) {
    background-color: $euiColorSecondary;
    animation-delay: .1s;
  }

  &:nth-child(3) {
    background-color: $euiColorAccent;
    animation-delay: .2s;
  }

  &:nth-child(4) {
    background-color: $euiColorDarkestShade;
    animation-delay: .3s;
  }
}

.euiLoadingChart--mono {
  .euiLoadingChart__bar {
    &:nth-child(1) {
      background-color: $euiColorLightShade;
    }

    &:nth-child(2) {
      background-color: shadeOrTint($euiColorLightShade, 4%, 4%);
    }

    &:nth-child(3) {
      background-color: shadeOrTint($euiColorLightShade, 8%, 8%);
    }

    &:nth-child(4) {
      background-color: shadeOrTint($euiColorLightShade, 12%, 12%);
    }
  }
}

.euiLoadingChart--medium {
  height: $euiSize;

  > span {
    width: $euiSizeXS / 2;
    margin-left: $euiSizeXS / 2;
    margin-bottom: $euiSizeS;
  }
}

.euiLoadingChart--large {
  height: $euiSizeL;

  > span {
    width: $euiSizeXS;
    margin-left: $euiSizeXS / 2;
    margin-bottom: $euiSizeL / 2;
  }
}

.euiLoadingChart--xLarge {
  height: $euiSizeXL;

  > span {
    width: $euiSizeS;
    margin-left: $euiSizeXS;
    margin-bottom: $euiSizeXL / 2;
  }
}

@keyframes euiLoadingChart {
  0% {
    transform: translateY(0);
  }

  50% {
    transform: translateY(66%);
  }

  100% {
    transform: translateY(0);
  }
}

.euiLoadingContent__loader {
  display: block;
  width: 100%;
}

.euiLoadingContent__singleLine {
  display: block;
  width: 100%;
  height: $euiSize;
  margin-bottom: $euiSizeS;
  border-radius: $euiBorderRadius;
  overflow: hidden;

  &:last-child:not(:only-child) {
    width: 75%;
  }
}

.euiLoadingContent__singleLineBackground {
  display: block;
  width: 220%;
  height: 100%;
  background: linear-gradient(
    to right,
    $euiGradientStartStop 45%,
    $euiGradientMiddle 50%,
    $euiGradientStartStop 55%,
    );
  animation: euiLoadingContentGradientLoad 1.5s $euiAnimSlightResistance infinite;
}

@keyframes euiLoadingContentGradientLoad {
  0% {
    transform: translateX(-53%);
  }

  100% {
    transform: translateX(0);
  }
}

.euiLoadingSpinner {
  flex-shrink: 0; // Ensures it never scales down below it's intended size
  display: inline-block;
  width: $euiSizeXL;
  height: $euiSizeXL;
  border-radius: 50%;
  border: solid $euiSizeXS / 2 $euiColorLightShade;
  border-color: euiLoadingSpinnerBorderColors();
  animation: euiLoadingSpinner .6s infinite linear;
}

.euiLoadingSpinner--small {
  width: $euiSizeS;
  height: $euiSizeS;
  border-width: 1px;
}

.euiLoadingSpinner--medium {
  width: $euiSize;
  height: $euiSize;
  border-width: 1px;
}

.euiLoadingSpinner--large {
  width: $euiSizeL;
  height: $euiSizeL;
}

.euiLoadingSpinner--xLarge {
  width: $euiSizeXL;
  height: $euiSizeXL;
}

@keyframes euiLoadingSpinner {
  from {
    transform: rotate(0deg);
  }

  to {
    transform: rotate(359deg);
  }
}

/**
 * 1. Fix IE overflow issue (min-height) by adding a separate wrapper for the
 *    flex display. https://github.com/philipwalton/flexbugs#flexbug-3
 * 2. IE has trouble with min-widths on flex elements. Use the pixel value
 *    from our forms since that's usually the smallest we want them.
 */

.euiModal {
  border: $euiBorderThin;
  // This mixin overwrites some of the border above
  @include euiBottomShadowLarge($adjustBorders: true); // sass-lint:disable-line mixins-before-declarations
  display: flex; /* 1 */

  position: relative;
  background-color: $euiColorEmptyShade;
  border-radius: $euiBorderRadius;
  z-index: $euiZModal;
  min-width: $euiFormMaxWidth;
  animation: euiModal $euiAnimSpeedSlow $euiAnimSlightBounce;

  .euiModal__flex { /* 1 */
    flex: 1;
    display: flex;
    flex-direction: column;
    max-height: 75vh; // We overflow the modal body based off this
  }
}

.euiModal--maxWidth-default {
  max-width: map-get($euiBreakpoints, 'm');
}

.euiModal--confirmation {
  min-width: $euiFormMaxWidth;
}

.euiModalHeader {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: $euiSizeL $euiSizeXXL $euiSize $euiSizeL;
  flex-grow: 0;
  flex-shrink: 0;
}

.euiModalHeader__title {
  @include euiTitle('m');
}

.euiModalBody {
  flex-grow: 1;
  overflow: hidden;
  // The below fixes scroll on Chrome and Safari
  display: flex;
  flex-direction: column;

  .euiModalBody__overflow {
    @include euiYScrollWithShadows;
    padding: $euiSizeS $euiSizeL;
  }
}

.euiModalFooter {
  display: flex;
  justify-content: flex-end;
  padding: $euiSize $euiSizeL $euiSizeL;
  flex-grow: 0;
  flex-shrink: 0; // ensure the height of the footer is based off it's contents and doesn't squish

  > * + * {
    margin-left: $euiSize;
  }
}

// If a body doesn't exist, remove some extra padding from footer
.euiModalHeader + .euiModalFooter {
  padding-top: $euiSizeS;
}

// If a footer doesn't exist (body is the last element) add padding to the bottom
.euiModalBody:last-of-type .euiModalBody__overflow {
  padding-bottom: $euiSizeL;
}


// The actual size of the X button in pixels is a bit fuzzy because of all the
// button padding so there is some pixel pushing here.
.euiModal__closeIcon {
  background-color: transparentize($euiColorEmptyShade, .1);
  position: absolute;
  right: $euiSizeL - 7px;
  top: $euiSizeL - 7px;
  z-index: 3;
}

@keyframes euiModal {
  0% {
    opacity: 0;
    transform: translateY($euiSizeXL);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

// On mobile we fix modals as a takeover.
@include euiBreakpoint('xs', 's') {
  .euiModal {
    // sass-lint:disable-block no-important
    position: fixed;
    width: 100vw !important;
    max-width: none !important;
    min-width: 0 !important;
    left: 0;
    right: 0;
    bottom: 0;
    top: 0;
    border-radius: 0;
    border: none;

    &.euiModal--confirmation {
      @include euiBottomShadowLarge($euiShadowColorLarge, .1, false, true);
      top: auto;
    }

    .euiModal__flex { /* 1 */
      max-height: 100vh;
    }
  }

  .euiModalHeader {
    width: 100vw;
  }

  .euiModalFooter {
    background: $euiColorLightestShade;
    padding: $euiSizeM $euiSizeL !important; // sass-lint:disable-line no-important
    width: 100vw;
    justify-content: stretch;

    > * {
      flex: 1;

      + * {
        margin-left: 0;
      }
    }
  }

  .euiModalBody {
    width: 100vw;

    .euiModalBody__overflow {
      padding-bottom: $euiSizeL;
    }
  }
}

// Nav drawer. Global application navigation.

.euiNavDrawer {
  width: $euiNavDrawerWidthCollapsed;
  height: calc(100% - #{$euiNavDrawerTopPosition});
  position: fixed;
  left: 0;
  top: $euiNavDrawerTopPosition;
  overflow: hidden;
  z-index: $euiZHeader;
  background: $euiHeaderBackgroundColor;
  box-shadow: $euiNavDrawerSideShadow;
  transition: width $euiAnimSpeedExtraFast $euiAnimSlightResistance;
  display: flex;

  .euiNavDrawerMenu {
    @include euiScrollBar;
    overflow-y: auto;
    width: $euiNavDrawerWidthCollapsed;
    height: 100%;

    &-hasFooter {
      margin-bottom: $euiSizeXXL;
    }
  }

  .euiNavDrawer__expandButton {
    @include euiBottomShadowFlat;
    background-color: $euiColorEmptyShade;
    position: fixed;
    bottom: 0;
    width: $euiNavDrawerWidthCollapsed;
    transition: width $euiAnimSpeedExtraFast;
    z-index: $euiZHeader + 1;

    .euiListGroupItem__button {
      padding: $euiSizeM $euiSize;
    }
  }

  &.euiNavDrawer-isCollapsed  {
    &.euiNavDrawer-flyoutIsExpanded {
      width: $euiNavDrawerWidthCollapsed + $euiNavDrawerWidthExpanded;
    }

    .euiNavDrawerMenu {
      // Prevents scrollbar from overlapping links in collapsed form
      // sass-lint:disable-block no-vendor-prefixes
      // sass-lint:disable-block no-misspelled-properties
      -ms-overflow-style: -ms-autohiding-scrollbar;
      scrollbar-width: none;

      &::-webkit-scrollbar {
        width: 0;
        height: 0;
      }

      .euiListGroup:not(.euiNavDrawer__expandButton) .euiListGroupItem__button {
        max-width: $euiSizeXL;
      }

      .euiListGroupItem__extraAction {
        // Hides extra action from scrolling into view when tabbing in the collapsed view
        visibility: hidden;
      }
    }
  }

  &.euiNavDrawer-isExpanded {
    width: $euiNavDrawerWidthExpanded;

    .euiNavDrawerMenu,
    .euiNavDrawer__expandButton {
      width: $euiNavDrawerWidthExpanded;
    }

    &.euiNavDrawer-flyoutIsExpanded {
      width: $euiNavDrawerWidthExpanded + $euiNavDrawerWidthCollapsed;
    }
  }
}

.euiNavDrawerPage {
  height: 100%;

