$euiNavDrawerWidthCollapsed: $euiHeaderChildSize;
$euiNavDrawerSideShadow: 2px 0 2px -1px rgba($euiShadowColor, .3);

// Layout variables
$euiNavDrawerTopPosition: $euiHeaderChildSize + 1px;

// Animation variables
$euiNavDrawerExpandingDelay: $euiAnimSpeedNormal;
$euiNavDrawerContractingDelay: $euiAnimSpeedFast;
$euiNavDrawerExtendedDelay: $euiAnimSpeedExtraSlow * 2;
$euiNavDrawerMenuAddedDelay: $euiAnimSpeedExtraFast;

.euiNavDrawerFlyout {
  @include euiScrollBar;
  width: 0;
  height: 100%;
  padding: $euiSizeM $euiSizeS;
  overflow-y: auto;
  background-color: $euiNavDrawerBackgroundColor;
  border-left: $euiBorderThin;
  box-shadow: $euiNavDrawerSideShadow;
  visibility: hidden;
  opacity: 0;

  &.euiNavDrawerFlyout-isExpanded {
    visibility: visible;
    opacity: 1;
    width: $euiNavDrawerWidthExpanded;
    transition: opacity $euiAnimSpeedFast $euiNavDrawerContractingDelay, width $euiAnimSpeedNormal;
  }

  &.euiNavDrawerFlyout-isCollapsed {
    transition: opacity $euiAnimSpeedFast, width $euiAnimSpeedFast;
  }

  .euiNavDrawerFlyout__title {
    margin: 0 $euiSizeS $euiSizeXS;
  }

  .euiNavDrawerFlyout__listGroup {
    padding-left: 0;
    padding-right: 0;
  }
}

.euiNavDrawerGroup__item {
  .euiListGroupItem__label {
    transition: all $euiAnimSpeedExtraFast;
  }

  .euiListGroupItem__button {
    color: inherit; // Force color to inherit from regular text color in case it's an anchor tag

    &:focus {
      background-color: $euiFocusBackgroundColor;
      border-radius: $euiBorderRadius;
    }
  }

  .euiListGroupItem__icon {
    max-width: $euiSize;
  }
}

// Default icon will simulate an avatar but with coloring specific to
.euiNavDrawerGroup__itemDefaultIcon {
  @include innerBorder('dark', 50%, .05);
  @include size($euiSize);
  line-height: $euiSize;
  font-size: $euiSizeM;
  flex-shrink: 0; // Ensures it never scales down below it's intended size
  display: inline-block;
  text-align: center;
  vertical-align: middle;
  overflow: visible;
  font-weight: $euiFontWeightMedium; // Explicitly state so it doesn't get overridden by inheritence
  border-radius: 50%;

  &:after {
    top: -$euiSizeXS;
    left: -$euiSizeXS;
    right: -$euiSizeXS;
    bottom: -$euiSizeXS;
  }
}

