@import '../badge/beta_badge/mixins';

// Export basic class & modifiers
@include euiPanel($selector: 'euiPanel');

.euiPanel {
  @include hasBetaBadge($selector: 'euiPanel');
}

// Specific
@each $modifier, $amount in $euiPanelPaddingModifiers {
  .euiPanel.euiPanel--#{$modifier} {
    padding: $amount;

    // Overwrite @hasBetaBadge max-width depending upon padding
    .euiPanel__betaBadgeWrapper {
      max-width: calc(100% - #{$amount*2});
    }
  }
}

// Because of the animations and positioning involved, this code gets pretty
// repetitive. What you generally need to know if you work in here is that
// the positioning of the popovers (and the arrows attached to them)
// is handled through absolute positioning and then animated through the use
// of transforms.

.euiPopover {
  display: inline-block;
  position: relative;
  vertical-align: middle;
  max-width: 100%;
}

.euiPopover__anchor {
  display: inline-block;
}

.euiPopover--displayBlock {
  display: block;

  .euiPopover__anchor {
    display: block;
  }
}

/**
 * 1. Can expand further, but it looks weird if it's smaller than the originating button.
 * 2. Animation happens on the panel.
 * 3. Make sure the panel stays within the window.
 */
.euiPopover__panel {
  // Ignore linting for legibility of transition property, and the mixin performs an overwrite
  // sass-lint:disable-block indentation, mixins-before-declarations
  position: absolute;
  z-index: $euiZContentMenu;
  min-width: $euiButtonMinWidth; /* 1 */
  max-width: calc(100vw - #{$euiSizeXL}); /* 3 */
  backface-visibility: hidden;
  pointer-events: none;
  transition: /* 2 */
    opacity $euiAnimSlightBounce $euiAnimSpeedSlow,
    visibility $euiAnimSlightBounce $euiAnimSpeedSlow,
    transform $euiAnimSlightBounce ($euiAnimSpeedSlow + 100ms);
  opacity: 0; /* 2 */
  visibility: hidden; /* 2 */
  transform: translateY(0) translateX(0) translateZ(0); /* 2 */
  @include euiBottomShadow($adjustBorders: true);

  &.euiPopover__panel-isOpen {
    opacity: 1;
    visibility: visible;
    pointer-events: auto;
  }

  .euiPopover__panelArrow {
    position: absolute;
    width: 0;
    height: 0;

    // This fakes a border on the arrow.
    &:before {
      position: absolute;
      content: '';
      height: 0;
      width: 0;
    }

    // This part of the arrow matches the panel.
    &:after {
      position: absolute;
      content: '';
      height: 0;
      width: 0;
    }

    &.euiPopover__panelArrow--top {
      &:before {
        bottom: -$euiPopoverArrowSize + 1;
        border-left: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid transparent;
        border-top: $euiPopoverArrowSize solid $euiBorderColor;
      }

      &:after {
        bottom: -$euiPopoverArrowSize + 2;
        border-left: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid transparent;
        border-top: $euiPopoverArrowSize solid $euiColorEmptyShade;
      }
    }

    &.euiPopover__panelArrow--right {
      &:before {
        left: -$euiPopoverArrowSize;
        top: 50%;
        border-top: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid $euiBorderColor;
      }

      &:after {
        left: -$euiPopoverArrowSize + 1;
        top: 50%;
        border-top: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid $euiColorEmptyShade;
      }
    }

    &.euiPopover__panelArrow--bottom {
      &:before {
        top: -$euiPopoverArrowSize;
        border-left: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid $euiBorderColor;
      }

      &:after {
        top: -$euiPopoverArrowSize + 1;
        border-left: $euiPopoverArrowSize solid transparent;
        border-right: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid $euiColorEmptyShade;
      }
    }

    &.euiPopover__panelArrow--left {
      &:before {
        right: -$euiPopoverArrowSize + 1;
        top: 50%;
        border-top: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid transparent;
        border-left: $euiPopoverArrowSize solid $euiBorderColor;
      }

      &:after {
        right: -$euiPopoverArrowSize + 2;
        top: 50%;
        border-top: $euiPopoverArrowSize solid transparent;
        border-bottom: $euiPopoverArrowSize solid transparent;
        border-left: $euiPopoverArrowSize solid $euiColorEmptyShade;
      }
    }
  }


  &.euiPopover__panel-noArrow .euiPopover__panelArrow {
    display: none;
  }
}

.euiPopover__panel.euiPopover__panel-isOpen.euiPopover__panel--top {
  transform: translateY($euiPopoverTranslateDistance) translateZ(0);
}

.euiPopover__panel.euiPopover__panel-isOpen.euiPopover__panel--bottom {
  transform: translateY(-$euiPopoverTranslateDistance) translateZ(0);
}

.euiPopover__panel.euiPopover__panel-isOpen.euiPopover__panel--left {
  transform: translateX($euiPopoverTranslateDistance) translateZ(0);
}

.euiPopover__panel.euiPopover__panel-isOpen.euiPopover__panel--right {
  transform: translateX(-$euiPopoverTranslateDistance) translateZ(0);
}

@import '../panel/variables'; // grab the $euiPanelPaddingModifiers map

.euiPopoverTitle {
  @include euiPopoverTitle;

  // If the popover's containing panel has padding applied,
  // ensure the title expands to cover that padding and
  // take on the same amount of padding horizontally

  @each $modifier, $amount in $euiPanelPaddingModifiers {
    .euiPopover__panel.euiPanel--#{$modifier} & {
      padding: $euiSizeM $amount;
      margin: ($amount * -1) ($amount * -1) $amount;
    }
  }

}

@import '../panel/variables'; // grab the $euiPanelPaddingModifiers map

.euiPopoverFooter {
  @include euiPopoverFooter;

  // If the popover's containing panel has padding applied,
  // ensure the footer expands to cover that padding and
  // take on the same amount of padding horizontally

  @each $modifier, $amount in $euiPanelPaddingModifiers {
    .euiPopover__panel.euiPanel--#{$modifier} & {
      padding: $euiSizeM $amount;
      margin: $amount ($amount * -1) ($amount * -1);
    }
  }
}

/**
 * 1. Portal content is absolutely positioned (e.g. tooltips, popovers, flyouts).
 */
.euiBody-hasPortalContent {
  position: relative; /* 1 */
}

// This file uses uncommon vender prefixes not covered by our compiliers
// sass-lint:disable no-vendor-prefixes

.euiProgress {
  position: relative;
  overflow: hidden;
  background-color: $euiColorLightShade;
}

// Progress bars come in different sizes.
$euiProgressSizes: (
  xs: $euiSizeXS / 2,
  s: $euiSizeXS,
  m: $euiSizeS,
  l: $euiSize,
);

@each $name, $size in $euiProgressSizes {
  .euiProgress--#{$name} {
    height: $size;
  }
}

// https://css-tricks.com/html5-progress-element/
// Good resource if you need to work in here. There's some gotchas with
// dealing with cross-browser progress bars.
.euiProgress--native {
  display: block;
  width: 100%;
  appearance: none;
  border: none;

  &::-webkit-progress-bar {
    background-color: $euiColorLightShade;
  }

  &::-webkit-progress-value {
    transition: width $euiAnimSpeedNormal linear;
  }

  &::-moz-progress-bar {
    transition: width $euiAnimSpeedNormal linear;
  }
}

/**
 * An indeterminate bar has an unreliable end time. Because of a Firefox animation issue,
 * we apply this style to a <div> instead of a <progress> element.
 * See https://css-tricks.com/html5-progress-element/ for more info.
 */
.euiProgress--indeterminate {
  &:before {
    position: absolute;
    content: '';
    width: 100%;
    top: 0;
    bottom: 0;
    left: 0;
    transform: scaleX(0) translateX(0%);
    animation: euiProgress 1s $euiAnimSlightResistance infinite;
  }
}

// Progress bars can be set to fixed or absolute.
.euiProgress--fixed {
  position: fixed;
  z-index: $euiZHeader + 1;
}

.euiProgress--absolute {
  position: absolute;
}

.euiProgress--fixed,
.euiProgress--absolute {
  top: 0;
  left: 0;
  right: 0;
  background-color: transparent;

  &.euiProgress--native {
    &::-webkit-progress-bar {
      background-color: transparent;
    }

    &::-moz-progress-bar {
      background-color: transparent;
    }
  }
}

// Progress bars come in different colors.
$euiProgressColors: (
  primary: $euiColorPrimary,
  secondary: $euiColorSecondary,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
  accent: $euiColorAccent,
  subdued: $euiColorMediumShade,
);

@each $name, $color in $euiProgressColors {
  .euiProgress--#{$name} {
    &.euiProgress--native {
      &::-webkit-progress-value {
        background-color: $color;
      }

      &::-moz-progress-bar {
        background-color: $color;
      }
    }

    &.euiProgress--indeterminate {
      &:before {
        background-color: $color;
      }
    }
  }
}

@keyframes euiProgress {
  0% {
    transform: scaleX(1) translateX(-100%);
  }

  100% {
    transform: scaleX(1) translateX(100%);
  }
}

// These mobile children are hidden in everything but mobile view.
.euiSideNav__mobileToggle {
  display: none;
  border-bottom: $euiBorderThin;
  padding: $euiSize $euiSizeL;
  width: 100%;
  text-align: left;

  /**
   * 1. This toggle also works with EUI link, but we need the outline
   *    that comes with the focus state.
   */
  &:focus {
    outline: none;
  }
}

.euiSideNav__mobileIcon {
  fill: $euiColorPrimary;
}

.euiSideNav__mobileWrap {
  display: flex;
}

.euiSideNav__mobileTitle {
  flex-grow: 1;
  color: $euiColorPrimary;
}

.euiSideNav__hideButton {
  width: $euiSizeL;
  height: $euiSizeL;
  border-radius: $euiBorderRadius;
  border: $euiBorderThin;
  background: $euiColorEmptyShade;
  position: absolute;
  display: flex;
  align-items: center;
  justify-content: space-around;
  right: -$euiSizeXXL;
  top: $euiSizeXL;
}

@include euiBreakpoint('xs', 's') {
  /**
   * 1. Animation doesn't work against height. Need max-height instead.
   *    We set a value larger than what is needed to fake "auto".
   */
  .euiSideNav-isOpenMobile {
    .euiSideNav__content {
      visibility: visible;
      opacity: 1;
      margin: $euiSizeL;
      max-height: 5000px; /* 1 */
      transition: all $euiAnimSpeedNormal $euiAnimSlightResistance;
    }
  }

  .euiSideNav__mobileToggle {
    display: block;
  }

  .euiSideNav__content {
    visibility: hidden;
    opacity: 0;
    max-height: 0;
    margin: 0 $euiSizeL;
  }
}

/**
 * 1. Text-align defaults to center, so we have to override that.
 * 2. Need this on the button element to color the underline.
 */
.euiSideNavItemButton {
  @include euiFontSizeS;
  text-align: left; /* 1 */
  display: block;
  width: 100%;
  padding: $euiSizeXS / 2 0;
  color: $euiColorFullShade; /* 2 */

  &.euiSideNavItemButton--isClickable {
    &:hover .euiSideNavItemButton__label {
      text-decoration: underline;
    }

    // Focus state background regardless of index/selected state.
    &:focus {
      // sass-lint:disable-block no-important
      background-color: $euiFocusBackgroundColor !important;
    }
  }

  &.euiSideNavItemButton-isSelected {
    .euiSideNavItemButton__label {
      color: $euiColorPrimary;
      font-weight: $euiFontWeightMedium;
      text-decoration: underline;
    }
  }
}

.euiSideNavItemButton__content {
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.euiSideNavItemButton__icon {
  margin-right: $euiSizeS;
}

/**
  * 1. Enable ellipsis overflow to work (https://css-tricks.com/flexbox-truncated-text/)
  */
.euiSideNavItemButton__labelContainer {
  min-width: 0; /* 1 */
}

.euiSideNavItemButton__label {
  color: $euiColorDarkShade;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

/**
 * 1. Draw the vertical line to group an expanded item's child items together.
 */
.euiSideNavItem__items {
  position: relative;

  &:after { /* 1 */
    position: absolute;
    content: '';
    top: 0;
    bottom: $euiSizeM;
    width: 1px;
    background: $euiBorderColor;
    left: 0;
  }
}

.euiSideNavItem--root {
  &.euiSideNavItem--rootIcon > .euiSideNavItem__items {
    margin-left: $euiSizeL;
  }

  /**
   * 1. Create padding around focus area without indenting the item itself.
   * 2. Align icon and label to the left.
   */
  & > .euiSideNavItemButton {
    margin-bottom: $euiSizeS;
    padding: 0;
    padding-left: $euiSizeS; /* 1 */
    padding-right: $euiSizeS; /* 1 */
    margin-left: -$euiSizeS; /* 1 */
    width: calc(100% + #{$euiSizeS * 2}); /* 1 */

    .euiSideNavItemButton__content {
      justify-content: flex-start; /* 2 */
    }

    .euiSideNavItemButton__label {
      @include euiTitle('xs');
    }
  }


  & > .euiSideNavItem__items {
    position: static;
    margin-left: 0;

    &:after {
      display: none;
    }
  }

  & + & {
    margin-top: $euiSizeXL;
  }
}

.euiSideNavItem--trunk {
  /**
   * 1. Create padding around focus area without indenting the item itself.
   */
  & > .euiSideNavItemButton {
    padding-left: $euiSizeS; /* 1 */
    padding-right: $euiSizeS; /* 1 */
    margin-left: -$euiSizeS; /* 1 */
    width: calc(100% + #{$euiSizeS * 2}); /* 1 */
  }

  & > .euiSideNavItem__items {
    margin-left: $euiSizeS;
    width: 100%;
  }
}

.euiSideNavItem--branch {
  /**
   * 1. Absolutely position the horizontal tick connecting the item to the vertical line.
   */
  & > .euiSideNavItemButton {
    position: relative; /* 1 */
    padding-left: $euiSizeS;
    padding-right: $euiSizeS; /* 1 */

    &:after {
      position: absolute; /* 1 */
      content: '';
      top: 50%;
      left: 0;
      width: $euiSizeXS;
      height: 1px;
      background: $euiBorderColor;
    }
  }

  & > .euiSideNavItem__items {
    margin-left: $euiSize;
  }
}

.euiSideNavItem--hasChildItems {
  & > .euiSideNavItemButton-isOpen {
    .euiSideNavItemButton__label {
      color: $euiColorFullShade;
    }
  }
}

$spacerSizes: (
