  border: $euiBorderThin;
  border-radius: $euiBorderRadius;
}

.euiSelectableList__list {
  @include euiOverflowShadow;
  @include euiScrollBar;
}

.euiSelectableList__groupLabel {
  @include euiTitle('xxxs');
  display: flex;
  align-items: center;
  border-bottom: $euiSelectableListItemBorder;
}

.euiSelectableListItem {
  @include euiFontSizeS;

  padding: $euiSizeXS $euiSizeM;
  display: block; // Necessary to make sure it doesn't force the whole popover to be too wide
  width: 100%;
  text-align: left;
  color: $euiTextColor;

  &:not(:last-of-type) {
    border-bottom: $euiSelectableListItemBorder;
  }

  &:hover,
  &:focus {
    .euiSelectableListItem__text {
      text-decoration: underline;
    }
  }

  &:focus,
  &-isFocused {
    cursor: pointer;
    color: $euiColorPrimary;
    background-color: $euiFocusBackgroundColor;
  }

  &[disabled] {
    color: $euiColorMediumShade;
    cursor: not-allowed;

    &:hover {
      text-decoration: none;
    }
  }
}

.euiSelectableListItem__content {
  display: flex;
  align-items: center;
}

.euiSelectableListItem__icon,
.euiSelectableListItem__prepend {
  margin-right: $euiSizeM;
}

.euiSelectableListItem__append {
  margin-left: $euiSizeM;
}

.euiSelectableListItem__text {
  @include euiTextTruncate;
  flex-grow: 1; // Pushed appended content to the far right
}

/**
  * 1. Prevent really long input from overflowing the container.
  */
.euiSelectableMessage {
  padding: $euiSizeS;
  text-align: center;
  word-wrap: break-word; /* 1 */
}

.euiStat {
  // Modifier naming and colors.
  $titleColors: (
    subdued: $euiColorDarkShade,
    primary: $euiColorPrimary,
    secondary: $euiColorSecondary,
    danger: $euiColorDanger,
    accent: $euiColorAccent,
  );

  .euiStat__title {
    color: $euiColorFullShade;

    // Create color classes based upon the map.
    @each $name, $color in $titleColors {
      &--#{$name} {
        color: $color;
      }
    }
  }

  .euiStat__title-isLoading {
    animation: euiStatPulse 1.5s infinite ease-in-out;
  }

  .euiStat__description {
    color: map-get($titleColors, dark);
  }

  &.euiStat--leftAligned {
    text-align: left;
    align-items: flex-start;
  }

  &.euiStat--centerAligned {
    text-align: center;
    align-items: center;
  }

  &.euiStat--rightAligned {
    text-align: right;
    align-items: flex-end;
  }
}

@keyframes euiStatPulse {
  0% { opacity: 1; }
  50% { opacity: .25; }
  100% { opacity: 1; }
}

.euiStepNumber {
  @include createStepsNumber;

  .euiStepNumber__icon {
    position: relative;
    top: -2px;
  }

  &--complete {
    // Thicken the checkmark but adding a slight stroke.
    .euiStepNumber__icon {
      stroke: currentColor;
      stroke-width: .5px;
    }
  }

  &.euiStepNumber-isHollow {
    background-color: transparent;
    border: 2px solid $euiColorPrimary;
  }

  // Create modifiers based upon the map
  @each $name, $color in $euiStepStatusColorsToFade {
    &--#{$name} {
      $backgroundColor: $color;
      @if (saturation($color) > 0%) {
        $backgroundColor: tintOrShade($color, 90%, 70%);
      }

      $textColor: makeHighContrastColor($color, $backgroundColor);

      color: $textColor;
      background-color: $backgroundColor;

      &.euiStepNumber-isHollow {
        border-color: $color;
      }
    }
  }
}

@mixin createStepsNumber {
  @include size($euiStepNumberSize);

  display: inline-block;
  line-height: $euiStepNumberSize;
  border-radius: $euiStepNumberSize;
  text-align: center;
  color: $euiColorEmptyShade;
  background-color: $euiColorPrimary;
  font-size: $euiSize; // setting to actual base size will keep it aligned if base font-size changes
  font-weight: $euiFontWeightMedium;
}

$euiStepNumberSize: $euiSizeXL !default;
$euiStepNumberMargin: $euiSize !default;

// Modifier naming and colors.
$euiStepStatusColorsToFade: (
  warning: $euiColorWarning,
  danger: $euiColorDanger,
  disabled: lightOrDarkTheme($euiColorDarkShade, $euiColorLightShade),
  incomplete: lightOrDarkTheme($euiColorDarkShade, $euiColorLightShade),
) !default;

/**
 * 1. Ensure that the step number vertically aligns with the title text
 */

.euiStep {
  // Do not show the content border if it is the last step
  &:last-of-type .euiStep__content {
    border-left-color: transparent;
  }

  .euiTitle {
    line-height: $euiStepNumberSize; /* 1 */
  }

  .euiStep__circle {
    margin-right: $euiStepNumberMargin;
    vertical-align: top; /* 1 */

    &[class*='complete'],
    &[class*='warning'],
    &[class*='danger'] {
      animation: euiGrow $euiAnimSpeedFast $euiAnimSlightBounce;
    }

    &[class*='incomplete'] {
      border-color: $euiColorPrimary;
      animation: none;
    }
  }

  .euiStep__title {
    font-weight: $euiFontWeightMedium;
    display: inline-block;
  }

  .euiStep__content {
    border-left: $euiBorderThick;
    padding: $euiSize $euiSize $euiSizeXL;
    margin: $euiSizeS 0;

    // Align the content's contents with the title
    padding-left: ($euiStepNumberSize / 2) - 1px + $euiStepNumberMargin;

    // Align content border to horizontal center of step number
    margin-left: ($euiStepNumberSize / 2) - 1px;
  }
}

.euiSubSteps {
  padding: $euiSize;
  background-color: $euiColorLightestShade;
  margin-bottom: $euiSize;

  > *:last-child {
    margin-bottom: 0;
  }

  // change ordered list from numbers to lowercase letters
  .euiText & ol,
  & ol {
    list-style-type: lower-alpha;
  }
}

@mixin makeLineProgress {
  height: 2px;
  background-color: $euiColorPrimary;
}

/**
 * 1. Ensure the connecting lines stays behind the number
 * 2. Make each step the same width
 * 3. Make the content of each step align to the top, even if the steps are of varying heights,
 *    e.g. due to some of their titles wrapping to multiple lines
 */

.euiStepsHorizontal {
  display: flex;
  align-items: stretch;
  flex-grow: 1;
  background: transparentize($euiColorLightestShade, .5);
}

// Button containing item
.euiStepHorizontal {
  flex-grow: 1; /* 2 */
  flex-basis: 0%; /* 2 */
  padding: $euiSizeL $euiSize $euiSize;
  display: flex; /* 3 */
  flex-direction: column; /* 3 */
  align-items: center; /* 3 */
  justify-content: flex-start; /* 3 */
  cursor: pointer;
  position: relative;

  // focus & hover state
  &:focus:not(.euiStepHorizontal-isDisabled),
  &:hover:not(.euiStepHorizontal-isDisabled) {
    .euiStepHorizontal__number {
      @include euiFocusRing(large);

      // sass-lint:disable-block indentation
      transition: background-color $euiAnimSpeedNormal $euiAnimSlightResistance,
                  color $euiAnimSpeedNormal $euiAnimSlightResistance;
    }

    .euiStepHorizontal__title {
      text-decoration: underline;
    }
  }

  // disabled state
  &.euiStepHorizontal-isDisabled {
    cursor: not-allowed;
  }

  // create the connecting lines
  &::before,
  &::after {
    content: '';
    position: absolute;
    width: 50%;
    height: 1px;
    top: $euiSizeL + ($euiStepNumberSize / 2);
    background-color: $euiColorLightShade;
    z-index: $euiZLevel0; /* 1 */
  }

  &::before {
    left: 0;
  }

  &::after {
    right: 0;
  }

  // Remove the respective lines if the first or last child
  &:first-of-type::before {
    display: none;
  }

  &:last-of-type::after {
    display: none;
  }
}

.euiStepHorizontal__number {
  position: relative; /* 1 */
  z-index: $euiZLevel1; /* 1 */
  transition: all $euiAnimSpeedFast ease-in-out;
}

.euiStepHorizontal__title {
  @include euiTitle('xs');
  margin-top: $euiSizeS;
  font-weight: $euiFontWeightRegular;
  text-align: center;
  max-width: 100%; // IE Fix for wrapping text

  .euiStepHorizontal-isDisabled & {
    color: $euiColorDarkShade;
  }
}

// Complete state
.euiStepHorizontal-isComplete {
  &::before,
  &::after {
    @include makeLineProgress;
  }
}

// Selected state
.euiStepHorizontal-isSelected {
  .euiStepHorizontal__number:not([class*='danger']):not([class*='warning']) {
    @include euiSlightShadow(desaturate($euiColorPrimary, 20%));
  }

  &::before {
    @include makeLineProgress;
  }
}

// RESPONSIVE
@include euiBreakpoint('xs', 's') {
  .euiStepHorizontal {
    // reduce top padding and shift lines
    padding-top: $euiSize;

    &:before,
    &:after {
      top: $euiSize + $euiStepNumberSize / 2;
    }
  }

  // hide titles
  .euiStepHorizontal__title {
    display: none;
  }
}

/**
 * NOTE: table-layout: fixed causes a bug in IE11 and Edge (see #9929). It also prevents us from
 * specifying a column width, e.g. the checkbox column.
 */
.euiTable {
  @include euiFontSizeS;
  @include euiNumberFormat;

  width: 100%;
  table-layout: fixed;
  border: none;
  border-collapse: collapse;
  background-color: $euiColorEmptyShade;
}

// Compressed styles not for mobile
@include euiBreakpoint('m', 'l', 'xl') {
  .euiTable--compressed {
    .euiTableCellContent {
      @include euiFontSizeXS;
      padding: $euiTableCellContentPaddingCompressed;
    }
  }
}

.euiTableFooterCell,
.euiTableHeaderCell {
  @include euiTableCell;
  @include euiTitle('xxs');
  font-weight: $euiFontWeightMedium;
  border-top: none;

  .euiTableHeaderButton {
    text-align: left;
    font-weight: $euiFontWeightMedium;
  }

  .euiTableCellContent__text {
    @include euiFontSizeXS;
    font-weight: $euiFontWeightSemiBold;
  }
}

.euiTableHeaderButton {
  @include euiFontSizeS;
  color: inherit;
  width: 100%;

  &:hover,
  &:focus {
    .euiTableCellContent__text {
      text-decoration: underline;
      color: $euiColorPrimary;
    }

    .euiTableSortIcon {
      fill: $euiColorPrimary;
    }
  }
}

.euiTableSortIcon {
  margin-left: $euiSizeXS;
  flex-shrink: 0; // makes sure the icon doesn't change size because the text is long

  .euiTableHeaderButton-isSorted & {
    fill: $euiTitleColor;
  }
}

.euiTableHeaderCellCheckbox {
  @include euiTableCellCheckbox;
  border-top: none;
}

.euiTableRow {
  &:hover {
    background-color: $euiTableHoverColor;
  }

  &.euiTableRow-isExpandedRow {
    .euiTableRowCell {
      background-color: $euiTableHoverColor;
    }

    &.euiTableRow-isSelectable .euiTableCellContent {
      padding-left: $euiTableCellCheckboxWidth + $euiTableCellContentPadding;
    }
  }

  &.euiTableRow-isSelected {
    background-color: $euiTableSelectedColor;

    + .euiTableRow.euiTableRow-isExpandedRow .euiTableRowCell {
      background-color: $euiTableSelectedColor;
    }

    &:hover,
    &:hover + .euiTableRow.euiTableRow-isExpandedRow .euiTableRowCell  {
      background-color: $euiTableHoverSelectedColor;
    }
  }
}

.euiTableRowCell {
  @include euiTableCell;

  color: $euiTextColor;

  &.euiTableRowCell--isMobileHeader {
    display: none; // Hide if not mobile breakpoint
  }
}

.euiTableRowCellCheckbox {
  @include euiTableCellCheckbox;
}

// Must come after .euiTableRowCell selector for border to be removed
.euiTableFooterCell {
  background-color: $euiColorLightestShade;
  border-bottom: none;
}

/**
 * 1. Vertically align all children.
 * 2. The padding on this div allows the ellipsis to show if the content is truncated. If
 *    the padding was on the cell, the ellipsis would be cropped.
 * 3. Support wrapping.
 * 4. Prevent very long single words (e.g. the name of a field in a document) from overflowing
 *    the cell.
 */
.euiTableCellContent {
  overflow: hidden; /* 4 */
  display: flex;
  align-items: center; /* 1 */
  padding: $euiTableCellContentPadding; /* 2 */
}

.euiTableCellContent__text {
  @include euiTextOverflowWrap; /* 4 */
  min-width: 0;
  text-overflow: ellipsis;
}

.euiTableCellContent--alignRight {
  justify-content: flex-end;
  text-align: right;
}

.euiTableCellContent--alignCenter {
  justify-content: center;
  text-align: center;
}

.euiTableHeaderCell,
.euiTableFooterCell,
.euiTableCellContent--truncateText {
  white-space: nowrap; /* 3 */

  .euiTableCellContent__text {
    overflow: hidden;
  }
}

.euiTableCellContent--overflowingContent {
  overflow: visible;
  white-space: normal;
  //* 4 */ overflow-wrap is not supported on flex parents
  word-break: break-all; // Fallback for FF and IE
  word-break: break-word;
}

.euiTableCellContent--showOnHover {
  > *:not(:first-child) {
    margin-left: $euiSizeS;
  }
}

.euiTableRow-hasActions {
  .euiTableCellContent--showOnHover {
    .euiTableCellContent__hoverItem {
      flex-shrink: 0;
      opacity: .7;
      filter: grayscale(100%);
      transition: opacity $euiAnimSpeedNormal $euiAnimSlightResistance, filter $euiAnimSpeedNormal $euiAnimSlightResistance;
    }

    .expandedItemActions__completelyHide,
    .expandedItemActions__completelyHide:disabled,
    .expandedItemActions__completelyHide:disabled:hover,
    .expandedItemActions__completelyHide:disabled:focus,
    .euiTableRow:hover & .expandedItemActions__completelyHide:disabled {
      filter: grayscale(0%);
      opacity: 0;
    }
  }

  &:hover .euiTableCellContent--showOnHover .euiTableCellContent__hoverItem:not(:disabled) {
    &,
    &:hover,
    &:focus {
      opacity: 1;
      filter: grayscale(0%);
    }
  }
}

// Animate expanded row must be on the contents div inside

.euiTableRow-isExpandedRow .euiTableCellContent {
  overflow: hidden;
  animation: $euiAnimSpeedNormal $euiAnimSlightResistance 1 normal forwards growExpandedRow;
}

@keyframes growExpandedRow {
  0% {
    max-height: 0;
  }

  100% {
    max-height: 1000px;
  }
}

.euiTableRow-isClickable {
  &:hover {
    background-color: $euiTableHoverClickableColor;
    cursor: pointer;
  }

  &:focus {
    background-color: $euiTableFocusClickableColor;
  }
}

@mixin euiTableCell {
  vertical-align: middle;
  border-top: $euiBorderThin;
  border-bottom: $euiBorderThin;
}

@mixin euiTableCellCheckbox {
  @include euiTableCell;
  width: $euiTableCellCheckboxWidth;
  vertical-align: middle;
}

@mixin euiTableActionsBackgroundMobile {
  background-image: linear-gradient(to right, $euiTableActionsBorderColor 0, $euiTableActionsBorderColor 1px, transparent 1px, transparent 100%);
  background-size: $euiTableActionsAreaWidth 100%;
  background-position-x: right;
  background-repeat: no-repeat;
}

// Deprecated mixins below. This was changed in Nov. 2018

@mixin euiTableActionsBackground--mobile { // sass-lint:disable-line mixin-name-format
  @include euiTableActionsBackgroundMobile;
  @warn '@mixin euiTableActionsBackground--mobile is deprecated, please use euiTableActionsBackgroundMobile instead';
}

// Spacing

$euiTableCellContentPadding: $euiSizeS;
$euiTableCellContentPaddingCompressed: $euiSizeXS;

$euiTableCellCheckboxWidth: $euiSizeXL;

$euiTableActionsAreaWidth: $euiSizeXXL;

// Colors

$euiTableHoverColor: tintOrShade($euiColorLightestShade, 50%, 20%);
$euiTableSelectedColor: tintOrShade($euiFocusBackgroundColor, 30%, 0%);
$euiTableHoverSelectedColor: tintOrShade($euiFocusBackgroundColor, 0, 10%);
$euiTableActionsBorderColor: transparentize($euiColorMediumShade, .9);
$euiTableHoverClickableColor: transparentize($euiColorPrimary, .95);
$euiTableFocusClickableColor: transparentize($euiColorPrimary, .9);

@import '../panel/mixins';

.euiTableRowCell__mobileHeader {
  // Don't display by default unless table is responsive
  display: none;
}

@include euiBreakpoint('xs', 's') {
  .euiTableRowCell--hideForMobile { // must come last to override any special cases
    // sass-lint:disable-block no-important
    display: none !important;
  }
}

@include euiBreakpoint('m', 'l', 'xl') {
  .euiTableRowCell--hideForDesktop { // must come last to override any special cases
    // sass-lint:disable-block no-important
    display: none !important;
  }
}

@include euiBreakpoint('xs', 's') {

  .euiTable.euiTable--responsive {
    // Not allowing compressed styles in mobile view (for now)

    thead {
      display: none; // Use mobile versions of selecting and filtering instead
    }

    tfoot {
      display: none; // Not supporting responsive footer content
    }

    // Make each row a Panel
    @include euiPanel($selector: 'euiTableRow');

    .euiTableRowCell__mobileHeader {
      // Always truncate
      @include euiTextTruncate;
      @include fontSize($euiFontSize * .6875);

      display: block;
      color: $euiColorDarkShade;
      padding: $euiSizeS;
      padding-bottom: 0;
      margin-bottom: -$euiSizeS; // pull up cell content closer
      min-height: $euiSizeL; // aligns contents of cells if header doesn't exist

      // Remove min-height of cell header if it's the only cell
      .euiTableRowCell:only-child & {
        min-height: 0;
      }
    }

    .euiTableRowCell--enlargeForMobile {
      @include euiFontSize;
    }

    .euiTableRowCell--isMobileFullWidth {
      width: 100%;

      .euiTableCellContent--alignCenter {
        justify-content: center;
        text-align: center;
      }
    }

    .euiTableRow {
      display: flex;
      flex-wrap: wrap;
      padding: $euiTableCellContentPadding;
      margin-bottom: $euiTableCellContentPadding;

      &:hover {
        background-color: transparent;
      }

      &.euiTableRow-isExpandable,
      &.euiTableRow-hasActions {
        @include euiTableActionsBackgroundMobile;
        padding-right: $euiSizeXXL;
        position: relative;
      }

      &.euiTableRow-isExpandable .euiTableRowCell--isExpander,
      &.euiTableRow-hasActions .euiTableRowCell--hasActions {
        min-width: 0;
        width: $euiSizeL;
        position: absolute;
        top: $euiTableCellContentPadding + (($euiTableCellContentPadding * $euiLineHeight) - $euiTableCellContentPadding) + $euiSizeXS; // same as row padding-top + cell padding + 1/2 line height
        right: $euiTableCellContentPadding;

        &::before {
          display: none; // Don't display table headers
        }

        .euiTableCellContent {
          flex-direction: column;
          padding: 0;

          .euiLink {
            padding: $euiSizeXS;
          }
        }
      }

      &.euiTableRow-hasActions.euiTableRow-isExpandable {
        .euiTableRowCell--isExpander {
          top: auto;
          bottom: $euiSize; // same as row padding-bottom
        }
      }

      &.euiTableRow-isSelectable {
        padding-left: $euiTableCellCheckboxWidth + ($euiTableCellContentPadding / 2);
        position: relative;

        .euiTableRowCellCheckbox {
          position: absolute;
          left: $euiTableCellContentPadding / 2;
          top: $euiSizeS;
        }
      }

      // override hover & selected colors
      &.euiTableRow-isSelected {
        &,
        &:hover,
        + .euiTableRow.euiTableRow-isExpandedRow,
        &:hover + .euiTableRow.euiTableRow-isExpandedRow .euiTableRowCell {
          background-color: $euiTableSelectedColor;
        }
      }

      &.euiTableRow-isExpandedRow {
        @include euiTableActionsBackgroundMobile;
        @include euiBottomShadowSmall;
        margin-top: -$euiTableCellContentPadding * 2;
        position: relative;
        z-index: 2; // on top of it's parent/previous row
        border-top: none;
        border-top-left-radius: 0;
        border-top-right-radius: 0;
        padding-left: $euiSizeS; // override selectable as the padding is already applied via the contents

        &:hover {
          background-color: $euiColorEmptyShade; // keep white background to cover triggering row's border
        }

        .euiTableRowCell {
          width: calc(100% - #{$euiSizeXXL});

          &::before {
            display: none;
          }
        }
      }
    }

    .euiTableRowCell {
      display: block; /* IE requires block to grow and wrap. */
      min-width: 50%;
      border: none;
    }

    .euiTableRowCellCheckbox {
      border: none;
    }

    // never show hidden items and always show hover items on mobile,
    .euiTableRow-hasActions .euiTableCellContent--showOnHover {
      > * {
        margin-left: 0;
      }

      .expandedItemActions__completelyHide {
        display: none;
      }

      .euiTableCellContent__hoverItem {
        opacity: 1;
        filter: none;
        margin-left: 0;
        margin-bottom: $euiSizeS;
      }
    }

    // force all content back to left side
    .euiTableCellContent--alignRight {
      justify-content: flex-start;
    }

    .euiTableCellContent--alignCenter {
      justify-content: flex-start;
    }
  }
}

// Hide mobile-only elements by default
.euiTableHeaderMobile,
.euiTableHeaderCell--hideForDesktop {
  display: none;
}

@include euiBreakpoint('xs', 's') {

  .euiTableHeaderMobile {
    display: flex;
