}

.euiTabs {
  @include euiScrollBar;
  display: flex;
  max-width: 100%;
  overflow-x: auto;
  overflow-y: hidden; // don't scroll vertically when scrolling horizontally
  position: relative;

  // Changing height of scrollbar so it sits flush with border
  // sass-lint:disable no-vendor-prefixes
  &::-webkit-scrollbar {
    height: 3px;
  }

  &:not(.euiTabs--condensed)::before {
    background-color: $euiColorLightShade;
    bottom: 0;
    content: '';
    height: 1px;
    left: 0;
    position: absolute;
    right: 0;
  }
}

.euiTab {
  @include fontSize($euiTabFontSize);
  background-color: transparent;
  cursor: pointer;
  line-height: $euiLineHeight;
  padding: $euiSizeM $euiSize;
  position: relative;
  transition: color $euiAnimSpeedNormal $euiAnimSlightResistance, background-color $euiAnimSpeedNormal $euiAnimSlightResistance;

  &:hover:not(.euiTab-isSelected) {
    color: $euiTextColor;
    text-decoration: underline;
  }

  &:focus {
    background-color: $euiFocusBackgroundColor;
    text-decoration: underline;

    &::before {
      background-color: $euiColorLightShade;
      bottom: 0;
      content: '';
      height: 1px;
      left: 0;
      position: absolute;
      right: 0;
    }
  }

  &.euiTab-isDisabled {
    color: $euiColorMediumShade;

    &:hover {
      color: $euiColorMediumShade;
      cursor: not-allowed;
      text-decoration: none;
    }
  }

  &.euiTab-isSelected {
    color: $euiColorPrimary;
    cursor: default;

    &::after {
      animation: euiTab $euiAnimSpeedFast $euiAnimSlightResistance;
      background-color: $euiColorPrimary;
      bottom: 0;
      content: ' ';
      height: $euiBorderWidthThick;
      left: 0;
      position: absolute;
      width: 100%;
    }
  }

  // Small Tabs Group Modifier

  .euiTabs--small & {
    @include fontSize($euiTabFontSizeS);
    padding: $euiSizeS;
  }

  // Condensed Tabs Group Modifier

  .euiTabs--condensed & {
    font-weight: $euiFontWeightSemiBold;
    padding: $euiSizeS 0;

    &:focus {
      background-color: transparent;

      &::before {
        display: none;
      }
    }

    & + .euiTab {
      margin-left: $euiSizeL;
    }
  }

  // Expand Tabs Group Modifier

  .euiTabs--expand & {
    flex-basis: 0%;
    flex-grow: 1;
  }
}

.euiTab__content {
  display: block;
  overflow: hidden;
  text-overflow: ellipsis;
  transform: translateY(0);
  transition: transform $euiAnimSpeedFast $euiAnimSlightBounce;
  white-space: nowrap;
}

@keyframes euiTab {
  0% {
    transform: scaleX(0);
  }

  100% {
    transform: scaleX(1);
  }
}

.euiTitle {
  + .euiTitle {
    margin-top: $euiSizeL;
  }
}

.euiTitle--uppercase {
  text-transform: uppercase;
}

.euiTitle--xxxsmall {
  @include euiTitle('xxxs');
}

.euiTitle--xxsmall {
  @include euiTitle('xxs');
}

.euiTitle--xsmall {
  @include euiTitle('xs');
}

.euiTitle--small {
  @include euiTitle('s');
}

.euiTitle--medium {
  @include euiTitle('m');
}

.euiTitle--large {
  @include euiTitle('l');
}

/**
 * 1. Allow list to expand as items are added, but cap it at the screen height.
 * 2. Only show the scroll on hover. Generally, scrolling is bad for toasts.
 * 3. Allow some padding if a scroll shows up.
 */
.euiGlobalToastList {
  @include euiScrollBar;

  display: flex;
  flex-direction: column;
  align-items: stretch;
  position: fixed;
  z-index: $euiZToastList;
  bottom: 0;
  right: 0;
  width: $euiToastWidth + $euiSize + $euiSizeXL; /* 3 */
  padding-right: $euiSize;
  padding-left: $euiSizeXL;
  max-height: 100vh; /* 1 */

  &:hover {
    overflow-y: auto; /* 2 */
  }
}

.euiGlobalToastListItem {
  margin-bottom: $euiSize;
  margin-right: $euiSize;
  animation: $euiAnimSpeedNormal euiShowToast $euiAnimSlightResistance;
  opacity: 1;

  /**
   * 1. justify-content: flex-end interferes with overflowing content, so we'll use this to push
   *    items to the bottom instead.
   */
  &:first-child {
    margin-top: auto; /* 1 */
  }

  &.euiGlobalToastListItem-isDismissed {
    transition: opacity $euiAnimSpeedNormal;
    opacity: 0;
  }
}

@keyframes euiShowToast {
  from {
    transform: translateY($euiSizeL) scale(.9);
    opacity: 0;
  }

  to {
    transform: translateY(0) scale(1);
    opacity: 1;
  }
}

@include euiBreakpoint('xs', 's') {
  /**
   * 1. Mobile we make these 100%. Matching change happens on the item as well.
   */
  .euiGlobalToastList {
    left: 0;
    padding-left: $euiSize;
    width: 100%; /* 1 */
  }
}

.euiToast {
  border: $euiBorderThin;
  // This overwrites some of the border above
  // sass-lint:disable-block mixins-before-declarations
  @include euiBottomShadowLarge($adjustBorders: true);

  position: relative;
  padding: $euiSize;
  background-color: $euiColorEmptyShade;
  width: 100%;

  &:hover .euiToast__closeButton,
  &:focus .euiToast__closeButton {
    opacity: 1;
  }
}

/**
  * 1. Fit button to icon.
  */
.euiToast__closeButton {
  position: absolute;
  top: $euiSize;
  right: $euiSize;
  line-height: 0; /* 1 */
  appearance: none;
  opacity: 0;
  transition: opacity $euiAnimSpeedFast $euiAnimSlightResistance;

  svg {
    fill: tintOrShade($euiTitleColor, 50%, 70%);
  }

  &:hover {
    svg {
      fill: $euiTitleColor;
    }
  }

  &:focus {
    background-color: $euiFocusBackgroundColor;
    opacity: 1;

    svg {
      fill: $euiColorPrimary;
    }
  }
}

// Modifier naming and colors.
$toastTypes: (
  primary: $euiColorPrimary,
  success: $euiColorSecondary,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
);

// Create button modifiders based upon the map.
@each $name, $color in $toastTypes {
  .euiToast--#{$name} {
    border-top: 2px solid $color;
  }
}

/**
 * 1. Align icon with first line of title text if it wraps.
 * 2. Apply margin to all but last item in the flex.
 * 3. Account for close button.
 */
.euiToastHeader {
  padding-right: $euiSizeL; /* 3 */
  display: flex;
  align-items: baseline; /* 1 */

  > * + * {
    margin-left: $euiSizeS; /* 2 */
  }
}

/**
  * 1. Vertically center icon with first line of title.
  */
.euiToastHeader__icon {
  flex: 0 0 auto;
  fill: $euiTitleColor;
  transform: translateY(2px); /* 1 */
}

.euiToastHeader__title {
  @include euiTitle('xs');
  font-weight: $euiFontWeightLight;
}

.euiToastHeader--withBody {
  margin-bottom: $euiSizeM;
}

/**
 * 1. Prevent long lines from overflowing.
 */
.euiToastBody {
  word-wrap: break-word; /* 1 */
}

.euiToken {
  display: flex;
  align-items: center;
  justify-content: center;

  svg {
    width: 100%;
    height: 100%;
    margin: auto;
  }
}

.euiToken--circle {
  border-radius: 50%;
}

.euiToken--square {
  // These are pretty small elements, the standard size
  // is just slightly too large.
  border-radius: $euiBorderRadius - 1px;
}

.euiToken--small {
  width: $euiSize;
  height: $euiSize;

  &.euiToken--rectangle {
    padding: 0 $euiSizeXS;
  }
}

.euiToken--medium {
  width: $euiSizeL;
  height: $euiSizeL;

  &.euiToken--rectangle {
    padding: 0 $euiSizeS;
  }
}

.euiToken--large {
  width: $euiSizeXL;
  height: $euiSizeXL;

  &.euiToken--rectangle {
    padding: 0 ($euiSize * .5);
  }
}

.euiToken--rectangle {
  box-sizing: content-box;
}

$tokenTypes: (
  tokenTint01: $euiColorPrimary,
  tokenTint02: $euiColorAccent,
  tokenTint03: $euiColorVis3,
  tokenTint04: $euiColorVis7,
  tokenTint05: $euiColorVis1,
  tokenTint06: $euiColorVis5,
  tokenTint07: $euiColorVis0,
  tokenTint08: $euiColorVis9,
  tokenTint09: #F0F,
  tokenTint10: #26AB00,
  tokenTint11: #4C1604,
  tokenTint12: #666
);

@each $tintName, $tintValue in $tokenTypes {
  .euiToken--#{$tintName} {
    box-shadow: 0 0 0 1px $tintValue;

    $backgroundColor: tintOrShade($tintValue, 70%, 70%);
    background-color: $backgroundColor;

    &.euiToken--no-border {
      box-shadow: none;
    }

    &.euiToken--fill {
      background-color: $tintValue;

      svg {
        fill: $euiColorGhost;
      }
    }

    svg {
      fill: makeHighContrastColor($tintValue, $backgroundColor);
    }
  }
}

@import '../form/switch/mixins';

.euiToggle {
  position: relative;

  .euiToggle__input {
    @include euiHiddenSelectableInput;
    z-index: 1; // Increase z-index to ensure the input receives the pointer events

    &:disabled {
      cursor: not-allowed;
    }
  }
}

@mixin euiHiddenSelectableInput {
  position: absolute;
  // sass-lint:disable no-important
  opacity: 0 !important; // Make sure it's still hidden when :disabled
  width: 100%;
  height: 100%;
  cursor: pointer;
}

/*
 * 1. Shift arrow 1px more than half it's size to account for border radius
 */

.euiToolTip {
  @include euiToolTipStyle;
  @include euiToolTipAnimation('top');
  position: absolute;
  opacity: 0;

  // Animation delays
  &.euiToolTip--delayLong {
    animation-delay: $euiAnimSpeedNormal * 5;
  }

  // Custom sizing
  $arrowSize: $euiSizeM;
  $arrowPlusSize: (($arrowSize/2) + 1px) * -1; /* 1 */
  $arrowMinusSize: (($arrowSize/2) - 1px) * -1; /* 1 */

  .euiToolTip__arrow {
    content: '';
    position: absolute;
    transform-origin: center;
    border-radius: 2px;
    background-color: $euiTooltipBackgroundColor;
    width: $arrowSize;
    height: $arrowSize;

    transform: translateY($arrowPlusSize) rotateZ(45deg); /* 1 */
  }

  // Positions the arrow and animates in from the same side.
  &.euiToolTip--right {
    animation-name: euiToolTipRight;

    .euiToolTip__arrow {
      transform: translateX($arrowMinusSize) rotateZ(45deg); /* 1 */
    }
  }

  &.euiToolTip--bottom {
    animation-name: euiToolTipBottom;

    .euiToolTip__arrow {
      transform: translateY($arrowMinusSize) rotateZ(45deg); /* 1 */
    }
  }

  &.euiToolTip--left {
    animation-name: euiToolTipLeft;

    .euiToolTip__arrow {
      transform: translateX($arrowPlusSize) rotateZ(45deg); /* 1 */
    }
  }

  .euiToolTip__title {
    @include euiToolTipTitle;
  }
}

.euiToolTipAnchor {
  display: inline-block;

  // disabled elements don't fire mouse events which means leaving a disabled element
  // wouldn't trigger the onMouseOut and hide the tooltip; disabling pointer events
  // on disabled elements means any mouse events remain handled by parent elements
  // https://jakearchibald.com/2017/events-and-disabled-form-fields/
  *[disabled] {
    pointer-events: none;
  }
}

// Keyframes to animate in the tooltip.
@keyframes euiToolTipTop {
  0% {
    opacity: 0;
    transform: translateY(-$euiSize);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

@keyframes euiToolTipBottom {
  0% {
    opacity: 0;
    transform: translateY($euiSize);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

@keyframes euiToolTipLeft {
  0% {
    opacity: 0;
    transform: translateX(-$euiSize);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

@keyframes euiToolTipRight {
  0% {
    opacity: 0;
    transform: translateX($euiSize);
  }

  100% {
    opacity: 1;
    transform: translateY(0);
  }
}

@mixin euiToolTipStyle($size: null) {
  @include euiBottomShadow($color: $euiColorInk);
  border-radius: $euiBorderRadius;
  background-color: $euiTooltipBackgroundColor;
  color: $euiColorGhost;
  z-index: $euiZLevel9;
  max-width: 256px;
  overflow-wrap: break-word;

  @if ($size == 's') {
    @include euiFontSizeXS;
    padding: $euiSizeS;
  } @else {
    @include euiFontSizeS;
    padding: $euiSizeM;
  }
}

@mixin euiToolTipTitle {
  font-weight: $euiFontWeightBold;
  border-bottom: solid 1px tintOrShade($euiColorFullShade, 35%, 80%);
  padding-bottom: $euiSizeXS;
  margin-bottom: $euiSizeXS;
}

@mixin euiToolTipAnimation($side: 'top', $delay: $euiAnimSpeedNormal) {
  animation: #{map-get($euiTooltipAnimations, $side)} $euiAnimSpeedSlow ease-out $euiAnimSpeedNormal forwards;
}

$euiTooltipBackgroundColor: tintOrShade($euiColorFullShade, 25%, 100%);

$euiTooltipAnimations: (
  top: euiToolTipTop,
  left: euiToolTipBottom,
  bottom: euiToolTipLeft,
  right: euiToolTipRight,
);

// This should only be used for .euiText, therefore it's not included in a separate mixin file

@mixin euiScaleText($baseFontSize) {
  $baseLineHeightMultiplier: $baseFontSize / 2;
  line-height: convertToRem($baseLineHeightMultiplier * 3);

  p,
  ul,
  ol,
  dl,
  blockquote,
  img,
  pre {
    margin-bottom: convertToRem($baseLineHeightMultiplier * 3);
  }

  ul,
  ol {
    margin-left: convertToRem($baseLineHeightMultiplier * 3);
  }

  blockquote {
    padding:  convertToRem($baseFontSize * 1.5);
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 4));
  }

  h1,
  h2,
  h3,
  h4,
  h5,
  h6 {
    margin-bottom: convertToRem($baseLineHeightMultiplier * 1);
  }

  dd + dt {
    margin-top: convertToRem($baseLineHeightMultiplier * 2);
  }

  * + h2,
  * + h3,
  * + h4,
  * + h5,
  * + h6 {
    margin-top: convertToRem($baseLineHeightMultiplier * 4);
  }

  h1 {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 1));
    line-height: convertToRem($baseLineHeightMultiplier * 6);
  }

  h2 {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 2));
    line-height: convertToRem($baseLineHeightMultiplier * 5);
  }

  h3 {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 3));
    line-height: convertToRem($baseLineHeightMultiplier * 4);
  }

  h4,
  dt,
  .eui-definitionListReverse dd {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 5)); // skip level 4 on purpose
    line-height: convertToRem($baseLineHeightMultiplier * 3);
  }

  .eui-definitionListReverse dt {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 7));
    color: $euiTextColor;
  }

  h5 {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 6));
    line-height: convertToRem($baseLineHeightMultiplier * 2);
  }

  h6 {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 7));
    line-height: convertToRem($baseLineHeightMultiplier * 2);
  }

  small {
    font-size: convertToRem($baseFontSize * nth($euiTextScale, 6));
  }

  pre {
    padding: $baseLineHeightMultiplier * 2;
  }

  code {
    // Setting the font size in rem's ensure it doesn't compound
    // the 90% set by euiCodeBlock
    font-size: convertToRem($baseFontSize * .9);
  }
}

.euiText {
  @include euiText;
  @include euiFontSize;
  // The euiText mixin forces a color. Since euiText is usually a child
  // of other styling concerns, we should inherit their coloring. The default
  // coloring will likely coming from the reset.scss anyway.
  color: inherit;

  // Style anchors that don't have a class. This prevents overwriting "buttons"
  // and other stylized elements passed in.
  a:not([class]) {
    color: $euiLinkColor;

    &:hover {
      color: darken($euiLinkColor, 10%);
      text-decoration: underline;
    }

    &:focus {
      text-decoration: underline;
      outline: solid 3px transparentize($euiLinkColor, .9);
      background-color: transparentize($euiLinkColor, .9);
    }
  }

  img {
    display: block;
    width: 100%;
  }

  ul {
    list-style: disc;
  }

  ol {
    list-style: decimal;
  }

  blockquote {
    position: relative;
    text-align: center;
    margin-left: auto;
    margin-right: auto;
    font-family: Georgia, Times, Times New Roman, serif;
    font-style: italic;
    letter-spacing: normal;

    p:last-child {
      margin-bottom: 0;
    }

    &:before,
    &:after {
      position: absolute;
      content: '';
      height: 2px;
      width: 50%;
      right: 0;
      transform: translateX(-50%);
      background: $euiColorDarkShade;
    }

    &:before {
      top: 0;
    }

    &:after {
      bottom: 0;
    }
  }

  h1 {
    @include euiTitle('l');
  }

  h2 {
    @include euiTitle('m');
  }

  h3 {
    @include euiTitle('s');
  }

  h4,
  dt {
    @include euiTitle('xs');
  }

  h5 {
    @include euiTitle('xxs');
  }

  h6 {
    @include euiTitle('xxxs');
    text-transform: uppercase;
  }

  pre {
    white-space: pre-wrap;
    background: $euiCodeBlockBackgroundColor;
    color: $euiCodeBlockColor;
  }

  pre,
  pre code {
    display: block;
  }

  // unset font-size from euiCodeBlock so it doesn't doubly add 90%

  code {
    @include euiCodeFont;
    display: inline-block; // ensures background stretches the full line-height
    font-weight: $euiFontWeightRegular;
  }

  @include euiScaleText($euiFontSize);

  &.euiText--constrainedWidth {
    max-width: $euiTextConstrainedMaxWidth;
    // If the max-width is way too short of the width of the container,
    // at least make it 2/3 of it's parent
    min-width: 75%;
  }

  &.euiText--small {
    @include fontSize($euiFontSizeS);
    @include euiScaleText($euiFontSizeS);
  }

  &.euiText--extraSmall {
    @include fontSize($euiFontSizeXS);
    @include euiScaleText($euiFontSizeXS);
  }

  > :last-child,
  .euiTextColor > :last-child {
    margin-bottom: 0 !important; // sass-lint:disable-line no-important
  }
}

$textColors: (
  default: $euiTextColor,
  subdued: $euiColorDarkShade,
  secondary: $euiColorSecondary,
  accent: $euiColorAccent,
  warning: $euiColorWarning,
  danger: $euiColorDanger,
  ghost: $euiColorGhost,
);

// Create color modifiers based on the map
@each $name, $color in $textColors {
  .euiTextColor--#{$name} {

    // The below function makes sure the color is accessible on our default background.
    color: makeHighContrastColor($color, $euiColorEmptyShade);

    @if $name == 'ghost' {
      color: $color !important; // sass-lint:disable-line no-important
    }
  }
}

.euiTextAlign--left {
  text-align: left;
}

.euiTextAlign--right {
  text-align: right;
}

.euiTextAlign--center {
  text-align: center;
}

