.rv-discrete-color-legend {
  box-sizing: border-box;
  overflow-y: auto;
  font-size: 12px;

  &.horizontal {
    white-space: nowrap;
  }
}

.rv-discrete-color-legend-item {
  color: $rv-legend-enabled-color;
  border-radius: 1px;
  padding: 9px 10px;

  &.horizontal {
    display: inline-block;

    .rv-discrete-color-legend-item__title {
      margin-left: 0;
      display: block;
    }
  }
}

.rv-discrete-color-legend-item__color {
  background: #dcdcdc;
  display: inline-block;
  height: 2px;
  vertical-align: middle;
  width: 14px;
}

.rv-discrete-color-legend-item__title {
  margin-left: 10px;
}

.rv-discrete-color-legend-item.disabled {
  color: $rv-legend-disabled-color;
}

.rv-discrete-color-legend-item.clickable {
  cursor: pointer;

  &:hover {
    background: #f9f9f9;
  }
}

.rv-search-wrapper {
  display: flex;
  flex-direction: column;
}

.rv-search-wrapper__form {
  flex: 0;
}

.rv-search-wrapper__form__input {
  width: 100%;
  color: #a6a6a5;
  border: 1px solid #e5e5e4;
  padding: 7px 10px;
  font-size: 12px;
  box-sizing: border-box;
  border-radius: 2px;
  margin: 0 0 9px;
  outline: 0;
}

.rv-search-wrapper__contents {
  flex: 1;
  overflow: auto;
}

.rv-continuous-color-legend {
  font-size: 12px;

  .rv-gradient {
    height: 4px;
    border-radius: 2px;
    margin-bottom: 5px;
  }
}

.rv-continuous-size-legend {
  font-size: 12px;

  .rv-bubbles {
    text-align: justify;
    overflow: hidden;
    margin-bottom: 5px;
    width: 100%;
  }

  .rv-bubble {
    background: #d8d9dc;
    display: inline-block;
    vertical-align: bottom;
  }

  .rv-spacer {
    display: inline-block;
    font-size: 0;
    line-height: 0;
    width: 100%;
  }
}

.rv-legend-titles {
  height: 16px;
  position: relative;
}

.rv-legend-titles__left,
.rv-legend-titles__right,
.rv-legend-titles__center {
  position: absolute;
  white-space: nowrap;
  overflow: hidden;
}

.rv-legend-titles__center {
  display: block;
  text-align: center;
  width: 100%;
}

.rv-legend-titles__right {
  right: 0;
}

.rv-radial-chart {

  .rv-xy-plot__series--label {
    pointer-events: none;
  }
}

.rv-treemap {
  font-size: 12px;
  position: relative;
}

.rv-treemap__leaf {
  overflow: hidden;
  position: absolute;
}

.rv-treemap__leaf--circle {
  align-items: center;
  border-radius: 100%;
  display: flex;
  justify-content: center;
}

.rv-treemap__leaf__content {
  overflow: hidden;
  padding: 10px;
  text-overflow: ellipsis;
}

.rv-xy-plot {
  width: 100% !important;  // this because react-vis fix the width of the container in px
  height: 100% !important; // avoid a correct computation of the component size
}

// NOTE: the current implementation of react-vis doesn't supports
// adding classes to grid lines but only a style prop is supported.
// We can overwrite here the original react-vis class or overwrite
// togheter with all other scss properties.

.rv-xy-plot__grid-lines__line {

  stroke-dasharray: 5 5;
  stroke-opacity: 0.3;
  // support a clean mouse over when grids is above elements
  pointer-events: none;
}

.euiAreaSeries {
  stroke-width: 0 !important;
}

// NOTE: opacity, stroke and fill are style by code inside react-vis
// we can overwrite and add !important for force svg styled component
// or overwrite style by code.

.euiBarSeries {
  rect {
    stroke-width: 1;
    stroke: white !important;
    rx: 2;
    ry: 2;
  }
}

.euiBarSeries--highDataVolume {
  rect {
    stroke-width: 0;
    rx: 0;
    ry: 0;
  }
}
.euiBarSeries--hoverEnabled {
  rect{
    &:hover {
      cursor: pointer;
    }
  }
}

// NOTE: opacity, stroke and fill are style by code inside react-vis
// we can overwrite and add !important for force svg styled component
// or overwrite style by code.

.euiHistogramSeries {
  rect {
    stroke-width: 1;
    stroke: white !important;
    rx: 2;
    ry: 2;
  }
}

.euiHistogramSeries--highDataVolume {
  rect {
    stroke-width: 0;
    rx: 0;
    ry: 0;
  }
}
.euiHistogramSeries--hoverEnabled {
  rect{
    &:hover {
      cursor: pointer;
    }
  }
}

.euiLegendTitle {
  @include euiTitle;
  @include euiFontSizeL;
}

.euiLegendContainer {
  display: flex;
  align-items: center;
  justify-content: flex-end;
}

.euiLegendContent {
  white-space: nowrap;
  color: gray;
  display: flex;
}

.euiLegendTruncatedLabel {
  display: inline-block;
}
.euiLegendSeriesValue {
  margin-left: 5px;
  display: inline-block;
  color: black;
}
.euiLegendMoreSeriesContainer {
  @include euiFontSizeS;
  color: gray;
}

.euiLegendItemContainer {
  display: flex;
  align-items: center;
  color: gray;
  cursor: pointer;
  user-select: none;
  margin-right: 4px;
  opacity: 1;
  @include euiFontSizeM;
  &:last-of-type {
    margin-right: 0;
  }
}

.euiLegendItemIndicator {
  border-radius: 100%;
  width: 8px;
  height: 8px;
  margin-right: 4px;
}

.euiTitle--small {
  // @include euiFontSizeM;
}

.euiTitle--large {
  // @include euiFontSizeXL;
}

.euiLineAnnotations__line {
  stroke: red;
  stroke-width: 2px;
  opacity: 0.3;
}
.euiLineAnnotations__text {
  font-size: $euiFontSizeXS;
  fill: red;
  stroke-width: 0;
  opacity: 0.3;
  alignment-baseline: text-after-edge;
}

.euiSeriesChartContainer__emptyPrompt {
  // Center the empty prompt within the series container
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}
